INSERT INTO `ci_sessions` (`session_id`, `ip_address`, `user_agent`, `last_activity`, `user_data`) VALUES
('00cb6dd0e358617b857b63418346087e', '::1', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/48.0.2564.116 Safari/537.36', 1457829998, 'a:9:{s:9:"user_data";s:0:"";s:6:"events";N;s:15:"recently_viewed";a:1:{i:0;a:18:{s:10:"product_id";s:2:"17";s:12:"product_type";s:6:"Tshirt";s:12:"product_game";s:11:"Programming";s:12:"product_name";s:12:"Coffee Stats";s:11:"product_url";s:39:"coffee stats programming t shirts india";s:13:"product_intro";s:54:"I convert caffeine into code. what''s your super power?";s:12:"product_desc";s:1112:"Disclaimer : Following story is based on real life incidents<br><br>\r\nSo it had been almost 2 hours and i had absolutely no clue what and where it was going wrong. Basically i wanted to show a pop-up on a successfully applied cheat code, but instead i was getting a blank white colored pop-up. That''s it, no text inside. i tried everything, debugged the shit out of the code, but i just couldn''t figure where was my text going!<br>\r\nSo finally,fully exhausted i went into the kitchen to make myself a cup of coffee while i think about the issue. Few sips down, i came back to my screen, opened my website and BAM! there it was, there was the problem right in front of me.<br><br>all my text was white colored<br><br>\r\nSo there I was trying to display white colored text on a white colored pop-up, i don''t know what made me realize this, but right at that moment i decided that i need to make a tee to show off all the benefits of coffee.\r\nSo here is the future me fulfilling my promise.\r\n<br><br>\r\nLet us know what you convert caffeine into. <br><br>\r\n\r\nScreen printed on a 100% cotton royal blue colored tshirt.";s:18:"product_image_path";s:23:"images/product/17/1.png";s:13:"product_price";s:3:"499";s:19:"product_count_small";s:1:"4";s:20:"product_count_medium";s:1:"5";s:19:"product_count_large";s:1:"5";s:16:"product_count_xl";s:1:"5";s:16:"product_qty_sold";s:1:"1";s:12:"product_date";s:19:"2016-02-25 23:1