('00f3bb1c1962a370d567f177c5bba035', '::1', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/63.0.3239.84 Safari/537.36', 1515359799, 'a:6:{s:9:"user_data";s:0:"";s:6:"events";N;s:7:"user_id";s:2:"93";s:8:"username";s:25:"ishkaran.fearme@gmail.com";s:6:"status";s:1:"1";s:15:"recently_viewed";a:2:{i:0;a:19:{s:10:"product_id";s:2:"49";s:12:"product_type";s:6:"tshirt";s:9:"design_id";s:1:"1";s:12:"product_game";s:9:"Deathnote";s:12:"product_name";s:15:"This is my cake";s:11:"product_url";s:49:"l the justice cake deathnote anime t shirts india";s:13:"product_intro";s:4:"blah";s:12:"product_desc";s:4:"blah";s:18:"product_image_path";s:38:"images/product/49/thisismycake_red.png";s:13:"product_price";s:3:"599";s:16:"product_qty_sold";s:1:"0";s:12:"product_date";s:19:"2017-12-25 00:42:10";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";s:14:"product_source";s:7:"inhouse";s:8:"featured";s:1:"0";s:8:"category";s:6:"Gaming";s:15:"product_details";a:7:{s:9:"tshirt_id";s:2:"50";s:10:"product_id";s:2:"49";s:9:"small_qty";s:1:"5";s:10:"medium_qty";s:1:"5";s:9:"large_qty";s:1:"5";s:6:"xl_qty";s:1:"5";s:13:"size_preorder";s:1:"0";}}i:1;a:19:{s:10:"product_id";s:2:"48";s:12:"product_type";s:6:"tshirt";s:9:"design_id";s:1:"1";s:12:"product_game";s:16:"Grand Theft Auto";s:12:"product_name";s:21:"Trevor The Psychopath";s:11:"product_url";s:49:"trevor the psychopath gta v gaming t shirts india";s:13:"product_intro";s:118:"Do you have that madness in you to match that of trevor''s? With this gta v inspired tee you can definitely achieve it.";s:12:"product_desc";s:2120:"So me and my friend was at this really good cafe whose food both of us religiously loved. My friend was lost in some kind of life contemplation zone for past few minutes now and I was waiting for him to snap out of it. Suddenly he comes out of the zone and says "i have figured it out" and calls the waiter,<br>\r\nThe waiter  wasn''t a regular seemed like a new hire, anyway and my friend just ordered a coke after all the "I have figured it out" excitement. I was a bit confused and looked at him with that "waiting for an explanation" expressions. He looks at me and goes like\r\n"I was trying to figure out which soft drink will taste best with this out of the world burger"<br><br>\r\nRight, talk about priorities.<br><br>\r\nhe got his glass of soft drink, takes a sip with so much excitement and just starts cursing loudly and I was like "calm down man. What happened?"<br>\r\nHe calls the waiter back<br>\r\nFriend : "What kind of joke is this?"<br>\r\nwaiter clearly a bit confused, but surely irritated,<br>\r\nWaiter : "what, I don''t understand?"<br>\r\nF: "i clearly remember ordering coke and you bring me a glass of pepsi, do you even understand the basics of how this world works."<br>\r\nNow waiter clearly losing his temper<br>\r\nW: "Don''t eat my head man, they are basically the same thing."<br>\r\nNow I don''t know which world this waiter was from but in my world this will lead to chaos and anarchy of a totally different scale.\r\nSo after a few broken glasses and plates, calling friends for backup, chasing a car on our bike and some bone shattering punches here and there, we finally managed to call it a day and head home.<br><br>\r\nAll the while I was reminded of this guy who deserves a design from us. Still don''t know what took us so long to bring this out.<br>\r\nAnyway now that it''s here feed your madness with this amazing ode to the guys who defines what true madness is, Tevor Phillips.<br><br>\r\nDesign By : Ajax Kumawat<br><br>\r\nLet us know your favorite moments of madness in comments below.<br>\r\nThis gta v inspired trevor gaming t-shirt is digitally printed on a 100% cotton black colored psycho store t shirt.";s:18:"product_image_path";s:28:"images/product/48/trevor.png";s:13:"product_price";s:3:"599";s:16:"product_qty_sold";s:1:"0";s:12:"product_date";s:19:"2017-11-27 21:08:42";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";s:14:"product_source";s:7:"inhouse";s:8:"featured";s:1:"0";s:8:"category";s:6:"Gaming";s:15:"product_details";a:7:{s:9:"tshirt_id";s:2:"49";s:10:"product_id";s:2:"48";s:9:"small_qty";s:1:"5";s:10:"medium_qty";s:1:"5";s:9:"large_qty";s:1:"5";s:6:"xl_qty";s:1:"5";s:13:"size_preorder";s:1:"0";}}}}'),
