('13ea026a4deeec6b169b30888d872ea3', '::1', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/48.0.2564.103 Safari/537.36', 1455129866, 'a:4:{s:15:"recently_viewed";a:1:{i:0;a:17:{s:10:"product_id";s:2:"15";s:12:"product_type";s:6:"Tshirt";s:12:"product_game";s:5:"Mario";s:12:"product_name";s:14:"One Up T Shirt";s:11:"product_url";s:33:"mario one up gaming t shirt india";s:13:"product_intro";s:58:"On the purchase of this t shirt you get an additional you!";s:12:"product_desc";s:678:"After years of extensive research, our scientists at psycho labs have finally cracked the formula that gave mario an extra life, equipped with this vital information our scientists have created this 1-up t shirt that will give you an extra life. So whatever the situation is, you can definitely count on this tee to give you 1-up. believe us this is psycho labs certified. <br><br>\r\n\r\nNote(our lawyers forced us to add this) : This description is supposed to be taken as a joke, don''t start banging your head against walls or start jumping down the clifs.\r\n<br><br>\r\nLet us know your views in the comments below. <br><br>\r\n\r\nScreen printed on a 100% cotton green colored tshirt.";s:18:"product_image_path";s:23:"images/product/15/1.png";s:13:"product_price";s:3:"350";s:19:"product_count_small";s:2:"20";s:20:"product_count_medium";s:2:"20";s:19:"product_count_large";s:2:"30";s:16:"product_count_xl";s:2:"30";s:16:"product_qty_sold";s:1:"0";s:12:"product_date";s:19:"2015-11-04 14:20:42";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";}}s:13:"cart_contents";a:4:{s:32:"a18addc28bf7e8c87e3d9426439688df";a:7:{s:5:"rowid";s:32:"a18addc28bf7e8c87e3d9426439688df";s:2:"id";s:2:"15";s:3:"qty";s:1:"1";s:5:"price";s:3:"350";s:4:"name";s:14:"One Up T Shirt";s:7:"options";a:1:{s:4:"Size";s:5:"Small";}s:8:"subtotal";i:350;}s:11:"total_items";i:1;s:10:"cart_total";i:350;s:11:"final_price";d:350;}s:8:"discount";a:2:{s:10:"percentage";i:0;s:6:"coupon";N;}s:6:"events";N;}'),
('15ad2bebbb00f16f0c534ded8fcfdb6f', '::1', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/51.0.2704.103 Safari/537.36', 1469439463, 'a:9:{s:9:"user_data";s:0:"";s:6:"events";N;s:15:"recently_viewed";a:1:{i:0;a:19:{s:10:"product_id";s:2:"20";s:12:"product_type";s:6:"Tshirt";s:12:"product_game";s:14:"Counter Strike";s:12:"product_name";s:19:"Loser Buy A Defuser";s:11:"product_url";s:55:"loser buy a defuser counter strike gaming t shirt india";s:13:"product_intro";s:134:"Dedicated to all those losers who never buy defusers. Always remember to wear this tee to a tournament as a reminder for you know who.";s:12:"product_desc";s:1880:"Based on real fictional events<br><br>\r\nIt was the dawn of the century where an epic battle that has been going for ages was about to come to an end. The balance of the force was about to be shifted to either of the side and it all rested on the capture of a very important and dusty camp site. Millions layed down their lives in their pursuit to capture that camp site. both sides suffered extreme losses, almost all of their global elites were nearing their ends. Just a handful of extremely elite ones remained along with some campers as well who were able to survive this long thanks to their noob camping skills. But there is indeed a thin line that even a noob camping guy should not cross and that is, trying to defuse a bomb without a defusal kit that too in the presence of global elites. Moreover if this particular bomb went off, it would have been an extremely heavy blow to their side.<br>\r\nThe guy defusing the bomb was reciting the prayer under his breath "In the name of the super saiyan god goku, the holy sons gohan and goten and the eternal dragon shenron'', please make this bomb defuse faster. Right then and there in the heat of the battle, a global elite made the right decision and gave a head shot to that guy, his own guy because he knew very well the consequences of the failure. he got to the bomb and defused it in a jiffy using the defusal kit and vowed to always wear a t shirt that would remind everyone not to act like that loser and to buy a defuser.<br><br>\r\nFast forward 30 years, peace has been restored to the valley and in rememberance of that fateful day, we are giving an opportunity to each and every one of you to wear this tee and remind the whole world around you to always and always buy a defuser.<br><br>\r\nLet us know your bomb defusal moments in the comments below. <br><br>\r\n\r\nScreen printed on a 100% cotton black colored t shirt.";s:18:"product_image_path";s:29:"images/product/20/defuser.png";s:13:"product_price";s:3:"499";s:19:"product_count_small";s:1:"5";s:20:"product_count_medium";s:1:"5";s:19:"product_count_large";s:1:"5";s:16:"product_count_xl";s:1:"5";s:16:"product_qty_sold";s:1:"0";s:12:"product_date";s:19:"2016-05-25 02:04:35";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:8:"preorder";s:7:"hashtag";s:12:"psychofamous";s:13:"size_preorder";s:1:"0";}}s:13:"cart_contents";a:4:{s:32:"bb0266a545f908d26e8a28b770144c0b";a:7:{s:5:"rowid";s:32:"bb0266a545f908d26e8a28b770144c0b";s:2:"id";s:2:"20";s:3:"qty";s:1:"1";s:5:"price";s:3:"499";s:4:"name";s:19:"Loser Buy A Defuser";s:7:"options";a:1:{s:4:"Size";s:6:"Medium";}s:8:"subtotal";i:499;}s:11:"total_items";i:1;s:10:"cart_total";i:499;s:11:"final_price";d:499;}s:8:"discount";a:2:{s:10:"percentage";i:0;s:6:"coupon";N;}s:6:"txn_id";s:8:"5795ddee";s:7:"user_id";s:2:"93";s:8:"username";s:25:"ishkaran.fearme@gmail.com";s:6:"status";s:1:"1";}'),
