('2213ed965fefc72433f2c301b9b10496', '::1', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/61.0.3163.100 Safari/537.36', 1508253152, 'a:9:{s:9:"user_data";s:0:"";s:6:"events";N;s:7:"user_id";s:2:"92";s:8:"username";s:4:"ishu";s:6:"status";s:1:"1";s:15:"recently_viewed";a:2:{i:0;a:19:{s:10:"product_id";s:2:"19";s:12:"product_type";s:6:"tshirt";s:9:"design_id";s:1:"9";s:12:"product_game";s:7:"Pokemon";s:12:"product_name";s:12:"Pikachu Face";s:11:"product_url";s:40:"pikachu face pokemon anime t shirt india";s:13:"product_intro";s:119:"Wear this tee and get ready to hear people around you yell "I chose you Pikachu". Also don''t forget to say "Pika Pika".";s:12:"product_desc";s:1373:"When we first got the challenge of creating a tee inspired from the legendary anime pokemon, we knew it wasn''t an easy task. Yes, obviously we can create a yet another pokemon tee, but we wanted you guys to actually feel that particular pokemon''s power run through your blood, when wearing that pokemon''s tee and we knew for that, we will need help from the one and only <a target="_blank" href="http://pokemon.wikia.com/wiki/Ash_Ketchum">Ash Ketchum</a>.<br><br>\r\nIt was tough but finally our satellites were able to track him down, we wasted no time in reaching him and told him of our situation, that we wanted to create a pikachu inspired tee which after wearing, should give people the ability to use <a target="_blank" href="http://pokemon.wikia.com/wiki/Thunderbolt">thunderbolt</a> attack and the special <a target="_blank" href="http://pokemon.wikia.com/wiki/Static">static</a> ability. <br><br>\r\nThough it took some convincing but our marketing team (special bonus for them this year) was able to woo him into letting our scientists take some dna samples from pikachu which they then infused with the t-shirt material from which this epic tee is created.<br><br>\r\nNote : Please don''t believe everything you read on the internet.<br><br>\r\nLet us know which other pokemons would you love to catch. <br><br>\r\n\r\nScreen printed on a 100% cotton yellow colored t shirt.";s:18:"product_image_path";s:27:"images/product/19/pika2.png";s:13:"product_price";s:3:"499";s:16:"product_qty_sold";s:2:"40";s:12:"product_date";s:19:"2016-04-11 19:41:39";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:8:"preorder";s:7:"hashtag";s:12:"psychofamous";s:14:"product_source";s:7:"inhouse";s:8:"featured";s:1:"0";s:8:"category";s:6:"Gaming";s:15:"product_details";a:7:{s:9:"tshirt_id";s:1:"4";s:10:"product_id";s:2:"19";s:9:"small_qty";s:1:"5";s:10:"medium_qty";s:1:"5";s:9:"large_qty";s:1:"5";s:6:"xl_qty";s:1:"5";s:13:"size_preorder";s:1:"0";}}i:1;a:19:{s:10:"product_id";s:2:"43";s:12:"product_type";s:6:"tshirt";s:9:"design_id";s:1:"1";s:12:"product_game";s:13:"Dragon Ball Z";s:12:"product_name";s:15:"Goku Kame Black";s:11:"product_url";s:49:"dragon ball z goku kame black anime t shirt india";s:13:"product_intro";s:86:"Continue your training at 100G now in this dragon ball z inspired black goku kame tee.";s:12:"product_desc";s:598:"Although we agree that nothing can beat the feeling of dressing up like goku, but well we realized that we are not actually inside an anime and we do not some variety with our clothes.<br> but yes it''s too tough to do your training in any dress that does not have a kame or kang kai''s symbol on it.<br><br>\r\nSo here it  is guys, for all you dragon ball z enthusiasts, get this goku kame black symbol tee.<br><br>\r\nLet us know your views in the comments below<br><br>\r\nThis goku black kame dragon ball z inspired anime t shirt is digitally printed on a 100% cotton blackcolored psycho store t shirt.";s:18:"product_image_path";s:32:"images/product/43/goku_black.png";s:13:"product_price";s:3:"599";s:16:"product_qty_sold";s:1:"0";s:12:"product_date";s:19:"2017-09-22 18:38:30";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, 