('348f038143a94d34459b44416c082582', '::1', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/53.0.2785.116 Safari/537.36', 1474575400, 'a:10:{s:9:"user_data";s:0:"";s:6:"events";N;s:15:"recently_viewed";a:5:{i:0;a:19:{s:10:"product_id";s:2:"19";s:12:"product_type";s:6:"tshirt";s:12:"product_game";s:7:"Pokemon";s:12:"product_name";s:12:"Pikachu Face";s:11:"product_url";s:40:"pikachu face pokemon anime t shirt india";s:13:"product_intro";s:119:"Wear this tee and get ready to hear people around you yell "I chose you Pikachu". Also don''t forget to say "Pika Pika".";s:12:"product_desc";s:1373:"When we first got the challenge of creating a tee inspired from the legendary anime pokemon, we knew it wasn''t an easy task. Yes, obviously we can create a yet another pokemon tee, but we wanted you guys to actually feel that particular pokemon''s power run through your blood, when wearing that pokemon''s tee and we knew for that, we will need help from the one and only <a target="_blank" href="http://pokemon.wikia.com/wiki/Ash_Ketchum">Ash Ketchum</a>.<br><br>\r\nIt was tough but finally our satellites were able to track him down, we wasted no time in reaching him and told him of our situation, that we wanted to create a pikachu inspired tee which after wearing, should give people the ability to use <a target="_blank" href="http://pokemon.wikia.com/wiki/Thunderbolt">thunderbolt</a> attack and the special <a target="_blank" href="http://pokemon.wikia.com/wiki/Static">static</a> ability. <br><br>\r\nThough it took some convincing but our marketing team (special bonus for them this year) was able to woo him into letting our scientists take some dna samples from pikachu which they then infused with the t-shirt material from which this epic tee is created.<br><br>\r\nNote : Please don''t believe everything you read on the internet.<br><br>\r\nLet us know which other pokemons would you love to catch. <br><br>\r\n\r\nScreen printed on a 100% cotton yellow colored t shirt.";s:18:"product_image_path";s:27:"images/product/19/pika2.png";s:13:"product_price";s:3:"499";s:19:"product_count_small";s:1:"5";s:20:"product_count_medium";s:1:"5";s:19:"product_count_large";s:1:"2";s:16:"product_count_xl";s:1:"5";s:16:"product_qty_sold";s:1:"4";s:12:"product_date";s:19:"2016-04-11 19:41:39";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:8:"preorder";s:7:"hashtag";s:12:"psychofamous";s:13:"size_preorder";s:1:"1";}i:1;a:19:{s:10:"product_id";s:2:"22";s:12:"product_type";s:6:"tshirt";s:12:"product_game";s:14:"Counter Strike";s:12:"product_name";s:21:"Invisble Wings Jersey";s:11:"product_url";s:59:"counter strike invisble wings official jersey t shirt india";s:13:"product_intro";s:77:"Show your support for team invisible wings, by wearing their official jersey.";s:12:"product_desc";s:772:"Team Invisible Wings literally came out of nowhere and has shook the Indian e-sports community with their continuous stellar performances and wins. <br>\r\nBacked by the awesome guys at <a href="http://tranzeneca.com/" target="_blank">Tranzeneca Gaming</a>, we are sure they will set the esports world on fire in the coming future.<br><br>\r\nMeanwhile show your support by sporting their killer looking official jersey.\r\n<br><br>\r\nNote : These orders are fulfilled by Invisible Wings themselves and not by Psycho Store, but you can rest assured about the quality.\r\n<br><br>\r\nInivisble Wings official jersey is made by using a delicate balance of cotton and polyster and is not 100% cotton like other psycho store tees.\r\n<br><br>\r\nLet us know your views in the comments below.";s:18:"product_image_path";s:23:"images/product/22/a.png";s:13:"product_price";s:3:"799";s:19:"product_count_small";s:1:"5";s:20:"product_count_medium";s:1:"5";s:19:"product_count_large";s:1:"5";s:16:"product_count_xl";s:1:"5";s:16:"product_qty_sold";s:1:"0";s:12:"product_date";s:19:"2016-08-28 23:52:25";s:1