 will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";s:13:"size_preorder";s:1:"0";}i:3;a:19:{s:10:"product_id";s:2:"11";s:12:"product_type";s:6:"tshirt";s:12:"product_game";s:12:"Breaking Bad";s:12:"product_name";s:6:"Bender";s:11:"product_url";s:39:"breaking bad gaming bender tshirt india";s:13:"product_intro";s:25:"Buy this awesome product.";s:12:"product_desc";s:0:"";s:18:"product_image_path";s:17:"images/bender.png";s:13:"product_price";s:3:"600";s:19:"product_count_small";s:1:"0";s:20:"product_count_medium";s:2:"13";s:19:"product_count_large";s:2:"20";s:16:"product_count_xl";s:1:"5";s:16:"product_qty_sold";s:2:"22";s:12:"product_date";s:19:"2014-12-09 01:13:46";s:19:"add_to_cart_comment";s:41:"Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";s:13:"size_preorder";s:1:"0";}i:4;a:15:{s:10:"product_id";s:2:"14";s:12:"product_type";s:6:"tshirt";s:12:"product_game";s:13:"One Punch man";s:12:"product_name";s:3:"OK.";s:11:"product_url";s:36:"one punch man ok anime t shirt india";s:13:"product_intro";s:111:"We can''t give you saitama''s powers, but his attitude is the closest thing that you can get by wearing this tee.";s:12:"product_desc";s:648:"We tried a lot to make a t shirt that would grant you saitama''s powers, but unfortunately our scientists couldn''t crack the code for that, but it''s not like that we have given up on it, believe us our scientists are still working on it. Meantime we came up with this innovative t shirt to give you a taste of saitama''s attitude towards life and especially problems. So however grave and dismal the situation be all you need to do is wear this t shirt and say ok and believe us its gonna be all right.<br><br>\r\nLet us know your views of your ok moments in the comments below. <br><br>\r\n\r\nScreen printed on a 100% cotton golden yellow colored tshirt.";s:18:"product_image_path";s:23:"images/product/14/1.png";s:13:"product_price";s:3:"599";s:16: