('621032d41dc273250e7c83ec5473d126', '::1', 'Mozilla/5.0 (Linux; Android 6.0; Nexus 5 Build/MRA58N) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/46.0.2490.76 Mobile', 1468597847, 'a:3:{s:9:"user_data";s:0:"";s:6:"events";N;s:15:"recently_viewed";a:1:{i:0;a:19:{s:10:"product_id";s:2:"18";s:12:"product_type";s:6:"Tshirt";s:12:"product_game";s:16:"Metal Gear Solid";s:12:"product_name";s:12:"Diamond Dogs";s:11:"product_url";s:50:"metal gear solid diamond dogs gaming t shirt india";s:13:"product_intro";s:70:"True diamond dogs wear this metal gear solid tee. Are you one of them?";s:12:"product_desc";s:605:"Do you remember the time which started the era of private military organisations and diamond dogs (1984 - 1995) was at the forefront of it who were willing to take up unsavory jobs for the clients but still at the same time always managed to maintain pride in their work. Not just this they were led by one of the most charismatic leader ever, the venom snake.<br><br>\r\nSo wear this tee with pride and show your support for those "dogs of war" and yes be a diamond dog yourself.<br><br>\r\nLet us know your views in the comments below. <br><br>\r\n\r\nScreen printed on a 100% cotton steel grey colored t shirt.";s:18:"product_image_path";s:23:"images/product/18/2.png";s:13:"product_price";s:3:"499";s:19:"product_count_small";s:1:"0";s:20:"product_count_medium";s:1:"5";s:19:"product_count_large";s:1:"5";s:16:"product_count_xl";s:1:"5";s:16:"product_qty_sold";s:1:"0";s:12:"product_date";s:19:"2016-04-08 01:12:13";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";s:13:"size_preorder";s:1:"1";}}}'),
('65da50145e728d509ceb256017fe98f7', '::1', 'Mozilla/5.0 (Linux; U; Android 4.0; en-us; GT-I9300 Build/IMM76D) AppleWebKit/534.30 (KHTML, like Gecko) Version/4.0 Mob', 1453729250, 'a:2:{s:9:"user_data";s:0:"";s:15:"recently_viewed";a:1:{i:0;a:17:{s:10:"product_id";s:2:"15";s:12:"product_type";s:6:"Tshirt";s:12:"product_game";s:5:"Mario";s:12:"product_name";s:14:"One Up T Shirt";s:11:"product_url";s:33:"mario one up gaming t shirt india";s:13:"product_intro";s:58:"On the purchase of this t shirt you get an additional you!";s:12:"product_desc";s:678:"After years of extensive research, our scientists at psycho labs have finally cracked the formula that gave mario an extra life, equipped with this vital information our scientists have created this 1-up t shirt that will give you an extra life. So whatever the situation is, you can definitely count on this tee to give you 1-up. believe us this is psycho labs certified. <br><br>\r\n\r\nNote(our lawyers forced us to add this) : This description is supposed to be taken as a joke, don''t start banging your head against walls or start jumping down the clifs.\r\n<br><br>\r\nLet us know your views in the comments below. <br><br>\r\n\r\nScreen printed on a 100% cotton green colored tshirt.";s:18:"product_image_path";s:23:"images/product/15/1.png";s:13:"product_price";s:3:"350";s:19:"product_count_small";s:2:"20";s:20:"product_count_medium";s:2:"20";s:19:"product_count_large";s:2:"30";s:16:"product_count_xl";s:2:"30";s:16:"product_qty_sold";s:1:"0";s:12:"product_date";s:19:"2015-11-04 14:20:42";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";}}}'),
