('66d329953c7b15d00e22b38114934b53', '::1', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/49.0.2623.87 Safari/537.36', 1458644112, 'a:6:{s:9:"user_data";s:0:"";s:7:"user_id";s:2:"66";s:8:"username";s:25:"ishkaran.fearme@gmail.com";s:6:"status";s:1:"1";s:6:"events";N;s:15:"recently_viewed";a:2:{i:0;a:18:{s:10:"product_id";s:2:"17";s:12:"product_type";s:6:"Tshirt";s:12:"product_game";s:11:"Programming";s:12:"product_name";s:12:"Coffee Stats";s:11:"product_url";s:39:"coffee stats programming t shirts india";s:13:"product_intro";s:54:"I convert caffeine into code. what''s your super power?";s:12:"product_desc";s:1112:"Disclaimer : Following story is based on real life incidents<br><br>\r\nSo it had been almost 2 hours and i had absolutely no clue what and where it was going wrong. Basically i wanted to show a pop-up on a successfully applied cheat code, but instead i was getting a blank white colored pop-up. That''s it, no text inside. i tried everything, debugged the shit out of the code, but i just couldn''t figure where was my text going!<br>\r\nSo finally,fully exhausted i went into the kitchen to make myself a cup of coffee while i think about the issue. Few sips down, i came back to my screen, opened my website and BAM! there it was, there was the problem right in front of me.<br><br>all my text was white colored<br><br>\r\nSo there I was trying to display white colored text on a white colored pop-up, i don''t know what made me realize this, but right at that moment i decided that i need to make a tee to show off all the benefits of coffee.\r\nSo here is the future me fulfilling my promise.\r\n<br><br>\r\nLet us know what you convert caffeine into. <br><br>\r\n\r\nScreen printed on a 100% cotton royal blue colored tshirt.";s:18:"product_image_path";s:23:"images/product/17/1.png";s:13:"product_price";s:3:"499";s:19:"product_count_small";s:1:"3";s:20:"product_count_medium";s:1:"5";s:19:"product_count_large";s:1:"5";s:16:"product_count_xl";s:1:"5";s:16:"product_qty_sold";s:1:"2";s:12:"product_date";s:19:"2016-02-25 23:15:10";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";}i:1;a:18:{s:10:"product_id";s:2:"16";s:12:"product_type";s:6:"Tshirt";s:12:"product_game";s:13:"The Witcher 3";s:12:"product_name";s:20:"Witcher 3 White Wolf";s:11:"product_url";s:41:"witcher 3 white wolf gaming t shirt india";s:13:"product_intro";s:113:"Get your hands on this witcher inspired tee, before you go wandering into the jungle in search of those monsters.";s:12:"product_desc";s:816:"We were really thrilled to hear that our team finally got the chance to interview the legendary monster hunter Geralt Of Rivia aka White Wolf. We really wanted to know the secret behind his speed and reflexes and to our surprise he actually gave us some magical substances to get the taste of his powers firsthand. Our scientists were hard at work for past 6 months to figure out a way to infuse those substances in the t shirts itself so that all our fans can taste Geralt''s powers. <br><br>\r\nSo here you go guys, after shit load of hardwork we present to you this magical tee infused with white wolf''s power and abilities so that even you can enjoy monster hunting now.\r\n<br><br>\r\nLet us know your monster hunting experiences in the comments below. <br><br>\r\n\r\nScreen printed on a 100% cotton black colored tshirt.";s:18:"product_image_path";s:23:"images/product/16/1.png";s:13:"product_price";s:3:"499";s:19:"product_count_small";s:1:"2";s:20:"product_count_medium";s:1:"5";s:19:"product_count_large";s:1:"5";s:16:"product_count_xl";s:1:"5";s:16:"product_qty_sold";s:1:"3";s:12:"product_date";s:19:"2016-02-25 17:28:21";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";}}}'),
('674eccc328dbad51be52f29c3afaa347', '::1', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/53.0.2785.116 Safari/537.36', 1474962514, 'a:9:{s:9:"user_data";s:0:"";s:6:"events";N;s:15:"recently_viewed";a:3:{i:0;a:15:{s:10:"product_id";s:2:"23";s:12:"product_type";s:6:"tshirt";s:12:"product_game";s:6:"naruto";s:12:"product_name";s:24:"Kamui Mangekyo Sharnigan";s:11:"product_url";s:51:"kamui mangekyo sharnigan naruto anime t shirt india";s:13:"product_intro";s:148:"Wear this naruto inspired t shirt to awaken the mangekyo sharingan inside you and gain the special ability of kamui just like obito and kakashi had.";s:12:"product_desc";s:969:"Ever since we came to know about the special and eternal power of mangekyo sharingan, we wanted one for ourself, but the icing on the cake was when we came to know about ''Kamui''. The special sharingan ability which can transfer people or best of all yourself to another dimension.<br><br>\r\nJust imagine being stuck with your boss or even gf/bf blabbering about this and that and poof! you are gone. Solves just so many of our problems, right?<br>\r\nWell, we are so excited to inform you that now you can actually own this power by wearing our kamui t shirt. We went to great lengths and put in a lot of effort to make sure this power comes to each and every one of us who has the will to awaken his/her mangekyo sharingan.<br><br>\r\nLet us know in the comments below which other powers/abilities you would like to gain and we will make sure to put them on our tees.<br><br>\r\nThis naruto anime t shirt is screen printed on a 100% cotton black colored psycho store t shirt.";s:18:"product_image_path";s:37:"images/product/23/kamui_sharingan.png";s:13:"product_price";s:3:"499";s:16:"product_qty_sold";s:1:"3";s:12:"product_date";s:19:"2016-09-10 02:48:49";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";s:15:"product_details";a:7:{s:9:"tshirt_id";s:1:"1";s:10:"product_id";s:2:"23";s:9:"small_qty";s:1:"5";s:10:"medium_qty";s:1:"4";s:9:"large_qty";s:2:"-1";s:6:"xl_qty";s:1:"5";s:13:"size_preorder";s:1:"0";}}i:1;a:15:{s:10:"product_id";s:2:"21";s:12:"product_type";s:6:"tshirt";s:12:"product_game";s:7:"Pokemon";s:12:"product_name";s:16:"Being Charmander";s:11:"product_url";s:43:"being charmander pokemon anime sthirt india";s:13:"product_intro";s:141:"We shall not be held responsible if after wearing this pokemon t shirt you somehow evolve from charmander to chairzard and become a lazy bum.";s:12:"product_desc";s:847:"So it had been quite some time since we caught our first pokemon (pikachu) and we decided it was time to again go pokemon hunting. Turns out the luck was on our side and we managed to capture this beauty, yes charmander it is. After capturing this cute little fiery beast our scientists tried to mimic it''s tail, where in the flame on it''s tail indicates chamander''s emotions. We thought we might be able to do something similar, but alas our scientists were not capable enough.\r\n<br><br>\r\nSo we thought chuck it, we will just capture the happy emotions from charmander and infuse it into the t shirt and that is exactly what we did. So we assure you that after wearing this pokemon t shirt, happiness is the only emotion you will feel.\r\n<br><br>\r\nThis charmander pokemon tee is screen printed on a 100% cotton orange colored psycho store t shirt.";s:18:"product_image_path";s:32:"images/product/21/charmander.png";s:13:"product_price";s:3:"499";s:16:"product_qty_sold";s:1:"1";s:12:"product_date";s:19:"2016-08-23 03:43:04";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";s:15:"product_details";a:0:{}}i:2;a:15:{s:10:"product_id";s:2:"20";s:12:"product_type";s:6:"tshirt";s:12:"product_game";s:14:"Counter Strike";s:12:"product_name";s:19:"Loser Buy A Defuser";s:11:"product_url";s:55:"loser buy a defuser counter strike gaming t shirt india";s:13:"product_intro";s:134:"Dedicated to all those losers who never buy defusers. Always remember to wear this tee to a tournament as a reminder for you know who.";s:12:"product_desc";s:1880:"Based on real fictional events<br><br>\r\nIt was the dawn of the century where an epic battle that has been going for ages was about to come to an end. The balance of the force was about to be shifted to either of the side and it all rested on the capture of a very important and dusty camp site. Millions layed down their lives in their pursuit to capture that camp site. both sides suffered extreme losses, almost all of their global elites were nearing their ends. Just a handful of extremely elite ones remained along with some campers as well who were able to survive this long thanks to their noob camping skills. But there is indeed a thin line that even a noob camping guy should not cross and that is, trying to defuse a bomb without a defusal kit that too in the presence of global elites. Moreover if this particular bomb went off, it would have been an extremely heavy blow to their side.<br>\r\nThe guy defusing the bomb was reciting the prayer under his breath "In the name of the super saiyan god goku, the holy sons gohan and goten and the eternal dragon shenron'', please make this bomb defuse faster. Right then and there in the heat of the battle, a global elite made the right decision and gave a head shot to that guy, his own guy because he knew very well the consequences of the failure. he got to the bomb and defused it in a jiffy using the defusal kit and vowed to always wear a t shirt that would remind everyone not to act like that loser and to buy a defuser.<br><br>\r\nFast forward 30 years, peace has been restored to the valley and in rememberance of that fateful day, we are giving an opportunity to each and every one of you to wear this tee and remind the whole world around you to always and always buy a defuser.<br><br>\r\nLet us know your bomb defusal moments in the comments below. <br><br>\r\n\r\nScreen printed on a 100% cotton black colored t shirt.";s:18:"product_image_path";s:29:"images/product/20/defuser.png";s:13:"product_price";s:3:"499";s:16:"product_qty_sold";s:1:"0";s:12:"product_date";s:19:"2016-05-25 02:04:35";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:8:"preorder";s:7:"hashtag";s:12:"psychofamous";s:15:"product_details";a:0:{}}}s:13:"cart_contents";a:4:{s:32:"71c67b8cfe6b2a7cecfcdd71fbac5ab0";a:7:{s:5:"rowid";s:32:"71c67b8cfe6b2a7cecfcdd71fbac5ab0";s:2:"id";s:2:"23";s:3:"qty";s:1:"1";s:5:"price";s:3:"499";s:4:"name";s:24:"Kamui Mangekyo Sharnigan";s:7:"options";a:1:{s:4:"Size";s:6:"Medium";}s:8:"subtotal";i:499;}s:11:"total_items";i:1;s:10:"cart_total";i:499;s:11:"final_price";d:449;}s:8:"discount";a:2:{s:10:"percentage";s:2:"10";s:6:"coupon";s:10:"uuddlrlrba";}s:6:"txn_id";s:8:"57ea0d24";s:7:"user_id";s:2:"93";s:8:"username";s:25:"ishkaran.fearme@gmail.com";s:6:"status";s:1:"1";}'),
