s father''s possessions and achieves inner peace.<br><br>\r\npsycho Store : We at psycho store are proud to present you the exact replica of the tshirt that luke found that day in his father''s possessions.\r\nSo embrace it with pride and achieve your inner peace and dont forget to fight the dark side.<br><br>\r\nLet us know your views in the comments below. <br><br>\r\n\r\nScreen printed on a 100% cotton orange tshirt.";s:18:"product_image_path";s:23:"images/product/14/1.png";s:13:"product_price";s:3:"599";s:19:"product_count_small";s:1:"8";s:20:"product_count_medium";s:2:"20";s:19:"product_count_large";s:2:"19";s:16:"product_count_xl";s:2:"20";s:16:"product_qty_sold";s:2:"13";s:12:"product_date";s:19:"2015-02-01 02:32:14";s:19:"add_to_cart_comment";s:41:"Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";}i:2;a:17:{s:10:"product_id";s:2:"12";s:12:"product_type";s:6:"Tshirt";s:12:"product_game";s:13:"Dragon ball z";s:12:"product_name";s:11:"Goku symbol";s:11:"product_url";s:37:"dragon ball z anime goku tshirt india";s:13:"product_intro";s:27:"kaa-mee-haa-mee-haaaaaaa !!";s:12:"product_desc";s:1275:"We were actually going to make a Goku dogi first, but we thought a tshirt would be much better for your wardrobe.<br> So wear this with pride and show off the fact that you are a distinguished warrior who underwent training from both master Roshi and King Kai, mastering in techniques like kamehameha, spirit bomb and kaio-ken.<br>\r\nBut never ever forget, what these symbols actually stand for, remember what goku taught us in the childhood, to never give up in the face of adversties, to always believe in yourself, to always have faith in yourself and always fight for whats right and stand against injustice.\r\nMost importantly never forget that you can achieve any level and overcome any obstacle, given that you are ready to put in the required effort to achieve it.<br>\r\nI dont think we need to tell you what your power level will be after wearing this tshirt, so wear this and we assure you that you will be able to face any damn thing in your life.\r\n<br><br>\r\nNote : Please dont come complaining back to us if you cant shoot energy beams through your hands, or if nothing happens when you shout kamehameha, be realistic guys, its just a t shirt after all.\r\n<br><br>\r\nLet us know your views in the comments below.\r\n<br><br>Screen printed on a 100% cotton orange tshirt.";s:18:"product_image_path";s:15:"images/goku.png";s:13:"product_price";s:3:"600";s:19:"product_count_small";s:1:"0";s:20:"product_count_medium";s:1:"8";s:19:"product_count_large";s:2:"10";s:16:"product_count_xl";s:2:"10";s:16:"product_qty_sold";s:2:"32";s:12:"product_date";s:19:"2014-12-09 01:13:46";s:19:"add_to_cart_comment";s:41:"Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";}i:3;a:17:{s:10:"product_id";s:2:"13";s:12:"product_type";s:6:"Tshirt";s:12:"product_game";s:7:"Fallout";s:12:"product_name";s:19:"Fallout : Nuka Cola";s:11:"product_url";s:37:"nuka cola fallout gaming tshirt india";s:13:"product_intro";s:135:"The most popular drink of the wasteland, now printed on a t shirt for you to wear and show your support for the post apocalyptic world.";s:12:"product_desc";s:796:"We have utmost respect for <a target="_blank" href="http://fallout.wikia.com/wiki/John-Caleb_Bradberton">John-Caleb Bradberton</a> for inventing the most popular soft drink ever. Even after the great war, nuka cola remains the #1 drink of the post apocalyptic world. Even their bottle caps can be seen being used as a currency in the new world. <br>\r\nSince everyone knows the fact that "War, War never changes", we bring to you the ice cold version of this drink for you to chill and deal with the fact.\r\n<br><br>Wear this t shirt and pay your tribute to one of the best rpg game ever made, that has been training you for years in case an apocalyptic situation arises.\r\n<br><br>\r\nLet us know your best nuka cola moments in the comments below. <br><br>\r\nScreen printed on a 100% cotton red tshirt.";s:18:"product_image_path";s:23:"images/product/13/1.png";s:13:"product_price";s:3:"600";s:19:"product_count_small";s:1:"0";s:20:"product_count_medium";s:2:"15";s:19:"product_count_large";s:2:"19";s:16:"product_count_xl";s:1:"6";s:16:"product_qty_sold";s:2:"20";s:12:"product_date";s:19:"2014-12-09 01:13:46";s:19:"add_to_cart_comment";s:41:"Wear this on a first date, you will rock.";s:13:"product_state";s:8:"preorder";}}s:7:"user_id";s:2:"66";s:8:"username";s:25:"ishkaran.fearme@gmail.com";s:6:"status";s:1:"1";s:6:"events";N;s:13:"cart_contents";a:4:{s:32:"a18addc28bf7e8c87e3d9426439688df";a:7:{s:5:"rowid";s:32:"a18addc28bf7e8c87e3d9426439688df";s:2:"id";s:2:"15";s:3:"qty";s:1:"1";s:5:"price";s:3:"350";s:4:"name";s:14:"One Up T Shirt";s:7:"options";a:1:{s:4:"Size";s:5:"Small";}s:8:"subtotal";i:350;}s:11:"total_items";i:1;s:10:"cart_total";i:350;s:11:"final_price";d:350;}s:8:"discount";a:2:{s:10:"percentage";i:0;s:6:"coupon";N;}s:6:"txn_id";s:8:"56a5cd21";}');
