('6d2afb9dcb27b0337f62c5d781ce24cd', '::1', 'Mozilla/5.0 (Windows NT 6.1; WOW64; rv:41.0) Gecko/20100101 Firefox/41.0', 1458151968, 'a:9:{s:9:"user_data";s:0:"";s:6:"events";N;s:15:"recently_viewed";a:1:{i:0;a:18:{s:10:"product_id";s:2:"16";s:12:"product_type";s:6:"Tshirt";s:12:"product_game";s:13:"The Witcher 3";s:12:"product_name";s:20:"Witcher 3 White Wolf";s:11:"product_url";s:41:"witcher 3 white wolf gaming t shirt india";s:13:"product_intro";s:113:"Get your hands on this witcher inspired tee, before you go wandering into the jungle in search of those monsters.";s:12:"product_desc";s:816:"We were really thrilled to hear that our team finally got the chance to interview the legendary monster hunter Geralt Of Rivia aka White Wolf. We really wanted to know the secret behind his speed and reflexes and to our surprise he actually gave us some magical substances to get the taste of his powers firsthand. Our scientists were hard at work for past 6 months to figure out a way to infuse those substances in the t shirts itself so that all our fans can taste Geralt''s powers. <br><br>\r\nSo here you go guys, after shit load of hardwork we present to you this magical tee infused with white wolf''s power and abilities so that even you can enjoy monster hunting now.\r\n<br><br>\r\nLet us know your monster hunting experiences in the comments below. <br><br>\r\n\r\nScreen printed on a 100% cotton black colored tshirt.";s:18:"product_image_path";s:23:"images/product/16/1.png";s:13:"product_price";s:3:"499";s:19:"product_count_small";s:1:"3";s:20:"product_count_medium";s:1:"5";s:19:"product_count_large";s:1:"5";s:16:"product_count_xl";s:1:"5";s:16:"product_qty_sold";s:1:"2";s:12:"product_date";s:19:"2016-02-25 17:28:21";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";}}s:13:"cart_contents";a:4:{s:32:"79e12a961fed317615a593764f2c304b";a:7:{s:5:"rowid";s:32:"79e12a961fed3176