('7214f466cc44665ba0a8aeda1aee0b0b', '::1', 'Mozilla/5.0 (Linux; Android 6.0; Nexus 5 Build/MRA58N) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/56.0.2924.87 Mobile', 1490684046, 'a:3:{s:9:"user_data";s:0:"";s:6:"events";N;s:15:"recently_viewed";a:2:{i:0;a:17:{s:10:"product_id";s:2:"28";s:12:"product_type";s:6:"tshirt";s:9:"design_id";s:1:"1";s:12:"product_game";s:9:"Half-Life";s:12:"product_name";s:28:"Black Mesa Research Facility";s:11:"product_url";s:59:"black mesa research facility half life gaming t shirt india";s:13:"product_intro";s:192:""Good morning and welcome to the black mesa transit system. Please wear this t-shirt at all times while handling any hazardous materials for your own safety." - Black mesa announcement system.";s:12:"product_desc";s:1091:"After the infamous <a href="http://combineoverwiki.net/wiki/Black_Mesa_Incident">black mesa incident</a>, we were approached by the black mesa management to create a special tee which would protect the scientists in case a similar incident was to happen again (and we were thinking "yeah right as if you really care about the scientists, we know what you did back then").<br>\r\nBut anyway business is business, so we accepted the offer, they obviously gave us some special chemical and xen substances to integrate in the t-shirt using which we made this half-life t-shirt which is in front of you.<br><br>\r\nWe were able to struck a deal with them where in we got the liberty to provide it to all our fans as well, just in case the next incident was to happen on a much larger scale (see how much we care about you guys).<br>\r\nDo wear this black mesa t-shirt at all times while handling any kind of hazardous materials.<br><br>\r\nLet us know your views in the comments below.<br><br>\r\nThis Half-life inspired gaming t shirt is screen printed on a 100% cotton white colored psycho store t shirt.";s:18:"product_image_path";s:32:"images/product/28/black_mesa.png";s:13:"product_price";s:3:"499";s:16:"product_qty_sold";s: