('7c6d0f16ffa16af31afc08c13ee24de5', '::1', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/49.0.2623.112 Safari/537.36', 1461482563, 'a:6:{s:9:"user_data";s:0:"";s:6:"events";N;s:7:"user_id";s:2:"66";s:8:"username";s:25:"ishkaran.fearme@gmail.com";s:6:"status";s:1:"1";s:15:"recently_viewed";a:4:{i:0;a:19:{s:10:"product_id";s:2:"17";s:12:"product_type";s:6:"Tshirt";s:12:"product_game";s:11:"Programming";s:12:"product_name";s:12:"Coffee Stats";s:11:"product_url";s:39:"coffee stats programming t shirts india";s:13:"product_intro";s:54:"I convert caffeine into code. what''s your super power?";s:12:"product_desc";s:1112:"Disclaimer : Following story is based on real life incidents<br><br>\r\nSo it had been almost 2 hours and i had absolutely no clue what and where it was going wrong. Basically i wanted to show a pop-up on a successfully applied cheat code, but instead i was getting a blank white colored pop-up. That''s it, no text inside. i tried everything, debugged the shit out of the code, but i just couldn''t figure where was my text going!<br>\r\nSo finally,fully exhausted i went into the kitchen to make myself a cup of coffee while i think about the issue. Few sips down, i came back to my screen, opened my website and BAM! there it was, there was the problem right in front of me.<br><br>all my text was white colored<br><br>\r\nSo there I was trying to display white colored text on a white colored pop-up, i don''t know what made me realize this, but right at that moment i decided that i need to make a tee to show off all the benefits of coffee.\r\nSo here is the future me fulfilling my promise.\r\n<br><br>\r\nLet us know what you convert caffeine into. <br><br>\r\n\r\nScreen printed on a 100% cotton royal blue colored tshirt.";s:18:"product_image_path";s:23:"images/product/17/1.png";s:13:"product_price";s:3:"499";s:19:"product_count_small";s:1:"0";s:20:"product_count_medium";s:1:"5";s:19:"product_count_large";s:1:"5";s:16:"product_count_xl";s:1:"5";s:16:"product_qty_sold";s:1:"2";s:12:"product_date";s:19:"2016-02-25 23:15:10";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";s:13:"size_preorder";s:1:"0";}i:1;a:19:{s:10:"product_id";s:2:"16";s:12:"product_type";s:6:"Tshirt";s:12:"product_game";s:13:"The Witcher 3";s:12:"product_name";s:20:"Witcher 3 White Wolf";s:11:"product_url";s:41:"witcher 3 white wolf gaming t shirt india";s:13:"product_intro";s:113:"Get your hands on this witcher inspired tee, before you go wandering into the jungle in search of those monsters.";s:12:"product_desc";s:816:"We were really thrilled to hear that our team finally got the chance to interview the legendary monster hunter Geralt Of Rivia aka White Wolf. We really wanted to know the secret behind his speed and reflexes and to our surprise he actually gave us some magical substances to get the taste of his powers firsthand. Our scientists were hard at work for past 6 months to figure out a way to infuse those substances in the t shirts itself so that all our fans can taste Geralt''s powers. <br><br>\r\nSo here you go guys, after shit load of hardwork we present to you this magical tee infused with white wolf''s power and abilities so that even you can enjoy monster hunting now.\r\n<br><br>\r\nLet us know your monster hunting experiences in the comments below. <br><br>\r\n\r\nScreen printed on a 100% cotton black colored tshirt.";s:18:"product_image_path";s:23:"images/product/16/1.png";s:13:"product_price";s:3:"499";s:19:"product_count_small";s:1:"2";s:20:"product_count_medium";s:1:"5";s:19:"product_count_large";s:1:"5";s:16:"product_count_xl";s:1:"5";s:16:"product_qty_sold";s:1:"3";s:12:"product_date";s:19:"2016-02-25 17:28:21";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";s:13:"size_preorder";s:1:"