('8834b32019bfebb2f3f53a81c88f3653', '::1', 'Mozilla/5.0 (compatible; MSIE 10.0; Windows Phone 8.0; Trident/6.0; IEMobile/10.0; ARM; Touch; NOKIA; Lumia 520)', 1457803282, 'a:8:{s:9:"user_data";s:0:"";s:6:"txn_id";s:8:"56e45012";s:6:"events";N;s:15:"recently_viewed";a:1:{i:0;a:18:{s:10:"product_id";s:2:"17";s:12:"product_type";s:6:"Tshirt";s:12:"product_game";s:11:"Programming";s:12:"product_name";s:12:"Coffee Stats";s:11:"product_url";s:39:"coffee stats programming t shirts india";s:13:"product_intro";s:54:"I convert caffeine into code. what''s your super power?";s:12:"product_desc";s:1112:"Disclaimer : Following story is based on real life incidents<br><br>\r\nSo it had been almost 2 hours and i had absolutely no clue what and where it was going wrong. Basically i wanted to show a pop-up on a successfully applied cheat code, but instead i was getting a blank white colored pop-up. That''s it, no text inside. i tried everything, debugged the shit out of the code, but i just couldn''t figure where was my text going!<br>\r\nSo finally,fully exhausted i went into the kitchen to make myself a cup of coffee while i think about the issue. Few sips down, i came back to my screen, opened my website and BAM! there it was, there was the problem right in front of me.<br><br>all my text was white colored<br><br>\r\nSo there I was trying to display white colored text on a white colored pop-up, i don''t know what made me realize this, but right at that moment i decided that i need to make a tee to show off all the benefits of coffee.\r\nSo here is the future me fulfilling my promise.\r\n<br><br>\r\nLet us know what you convert caffeine into. <br><br>\r\n\r\nScreen printed on a 100% cotton royal blue colored tshirt.";s:18:"product_image_path";s:23:"images/product/17/1.png";s:13:"product_price";s:3:"499";s:19:"product_count_small";s:1:"4";s:20:"product_count_medium";s:1:"5";s:19:"product_count_large";s:1:"5";s:16:"product_count_xl";s:1:"5";s:16:"product_qty_sold";s:1:"1";s:12:"product_date";s:19:"2016-02-25 23:15:10";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";}}s:13:"cart_contents";a:4:{s:32:"322be0441c2d640120b200cfb107c296";a:7:{s:5:"rowid";s:32:"322be0441c2d640120b200cfb107c296";s:2:"id";s:2:"17";s:3:"qty";s:1:"1";s:5:"price";s:3:"499";s:4:"name";s:12:"Coffee Stats";s:7:"options";a:1:{s:4:"Size";s:5:"Small";}s:8:"subtotal";i:499;}s:11:"total_items";i:1;s:10:"cart_total";i:499;s:11:"final_price";d:499;}s:8:"discount";a:2:{s:10:"percentage";i:0;s:6:"coupon";N;}s:22:"flash:new:captcha_word";s:8:"hMAJMK8D";s:22:"flash:new:captcha_time";d:1457803310.0958011150360107421875;}');
