('90c84404a09a488f25d9ed8053946b5a', '::1', 'Mozilla/5.0 (Linux; Android 6.0; Nexus 5 Build/MRA58N) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/55.0.2883.87 Mobile', 1483871525, 'a:5:{s:9:"user_data";s:0:"";s:6:"events";N;s:15:"recently_viewed";a:2:{i:0;a:15:{s:10:"product_id";s:2:"21";s:12:"product_type";s:6:"tshirt";s:12:"product_game";s:7:"Pokemon";s:12:"product_name";s:16:"Being Charmander";s:11:"product_url";s:43:"being charmander pokemon anime sthirt india";s:13:"product_intro";s:141:"We shall not be held responsible if after wearing this pokemon t shirt you somehow evolve from charmander to chairzard and become a lazy bum.";s:12:"product_desc";s:847:"So it had been quite some time since we caught our first pokemon (pikachu) and we decided it was time to again go pokemon hunting. Turns out the luck was on our side and we managed to capture this beauty, yes charmander it is. After capturing this cute little fiery beast our scientists tried to mimic it''s tail, where in the flame on it''s tail indicates chamander''s emotions. We thought we might be able to do something similar, but alas our scientists were not capable enough.\r\n<br><br>\r\nSo we thought chuck it, we will just capture the happy emotions from charmander and infuse it into the t shirt and that is exactly what we did. So we assure you that after wearing this pokemon t shirt, happiness is the only emotion you will feel.\r\n<br><br>\r\nThis charmander pokemon tee is screen printed on a 100% cotton orange colored psycho store t shirt.";s:18:"product_image_path";s:32:"images/product/21/charmander.png";s:13:"product_price";s:3:"499";s:16:"product_qty_sold";s:1:"4";s:12:"product_date";s:19:"2016-08-23 03:43:04";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";s:15:"product_details";a:7:{s:9:"tshirt_id";s:1:"3";s:10:"product_id";s:2:"21";s:9:"small_qty";s:1:"5";s:10:"medium_qty";s:1:"2";s:9:"large_qty";s:1:"5";s:6:"xl_qty";s:1:"5";s:13:"size_preorder";s:1:"0";}}i:1;a:15:{s:10:"product_id";s:2:"23";s:12:"product_type";s:6:"tshirt";s:12:"product_game";s:6:"naruto";s:12:"product_name";s:24:"Kamui Mangekyo Sharnigan";s:11:"product_url";s:51:"kamui mangekyo sharnigan naruto anime t shirt india";s:13:"product_intro";s:148:"Wear this naruto inspired t shirt to awaken the mangekyo sharingan inside you and gain the special ability of kamui just like obito and kakashi had.";s:12:"product_desc";s:969:"Ever since we came to know about the special and eternal power of mangekyo sharingan, we wanted one for ourself, but the icing on the cake was when we came to know about ''Kamui''. The special sharingan ability which can transfer people or best of all yourself to another dimension.<br><br>\r\nJust imagine being stuck with your boss or even gf/bf blabbering about this and that and poof! you are gone. Solves just so many of our problems, right?<br>\r\nWell, we are so excited to inform you that now you can actually own this power by wearing our kamui t shirt. We went to great lengths and put in a lot of effort to make sure this power comes to each and every one of us who has the will to awaken his/her mangekyo sharingan.<br><br>\r\nLet us know in the comments below which other powers/abilities you would like to gain and we will make sure to put them on our tees.<br><br>\r\nThis naruto anime t shirt is screen printed on a 100% cotton black colored psycho store t shirt.";s:18:"product_image_path";s:37:"images/product/23/kamui_sharingan.png";s:13:"product_price";s:3:"499";s:16:"product_qty_sold";s:2:"20";s:12:"product_date";s:19:"2016-09-10 02:48:49";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";s:15:"product_details";a:7:{s:9:"tshirt_id";s:1:"1";s:10:"product_id";s:2:"23";s:9:"small_qty";s:1:"1";s:10:"medium_qty";s:1:"3";s:9:"large_qty";s:1:"0";s:6:"xl_qty";s:1:"2";s: