ck.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";}i:4;a:18:{s:10:"product_id";s:1:"6";s:12:"product_type";s:6:"Tshirt";s:12:"product_game";s:11:"Half Life 2";s:12:"product_name";s:13:"Bahadur Bille";s:11:"product_url";s:45:"half life 2 bahadur bille gaming tshirt india";s:13:"product_intro";s:22:"Best FPS ever created.";s:12:"product_desc";s:192:"Be prepared the monster of the mosters, DOOM is coming near and so is the end along with it. Pay your tribute to one of the scariest and best fps ever created and yeah to John Carmack as well.";s:18:"product_image_path";s:19:"images/swatkats.png";s:13:"product_price";s:3:"600";s:19:"product_count_small";s:1:"6";s:20:"product_count_medium";s:2:"15";s:19:"product_count_large";s:2:"17";s:16:"product_count_xl";s:2:"10";s:16:"product_qty_sold";s:2:"12";s:12:"product_date";s:19:"2014-12-09 01:13:46";s:19:"add_to_cart_comment";s:72:"Psycho Store : Doom is coming near, this t-shirt will keep you prepared.";s:13:"product_state";s:8:"preorder";s:7:"hashtag";s:12:"psychofamous";}i:5;a:18:{s:10:"product_id";s:2:"19";s:12:"product_type";s:6:"Tshirt";s:12:"product_game";s:15:"Attack On Titan";s:12:"product_name";s:12:"Recon Corps.";s:11:"product_url";s:47:"recon corps attack on titan anime t shirt india";s:13:"product_intro";s:3:"AOT";s:12:"product_desc";s:3:"AOT";s:18:"product_image_path";s:23:"images/product/19/1.png";s:13:"product_price";s:3:"499";s:19:"product_count_small";s:1:"5";s:20:"product_count_medium";s:1:"5";s:19:"product_count_large";s:1:"5";s:16:"product_count_xl";s:1:"5";s:16:"product_qty_sold";s:1:"0";s:12:"product_date";s:19:"2016-04-11 19:41:39";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";}}s:7:"user_id";s:2:"66";s:8:"username";s:25:"ishkaran.fearme@gmail.com";s:6:"status";s:1:"1";s:13:"cart_contents";a:5:{s:32:"c868ed37ae7e33fdb81254df7ce3c591";a:7:{s:5:"rowid";s:32:"c868ed37ae7e33fdb81