('a8d5b892b935bc197801328bffe7e688', '::1', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/53.0.2785.143 Safari/537.36', 1475841200, 'a:6:{s:9:"user_data";s:0:"";s:6:"events";N;s:15:"recently_viewed";a:4:{i:0;a:15:{s:10:"product_id";s:2:"23";s:12:"product_type";s:6:"tshirt";s:12:"product_game";s:6:"naruto";s:12:"product_name";s:24:"Kamui Mangekyo Sharnigan";s:11:"product_url";s:51:"kamui mangekyo sharnigan naruto anime t shirt india";s:13:"product_intro";s:148:"Wear this naruto inspired t shirt to awaken the mangekyo sharingan inside you and gain the special ability of kamui just like obito and kakashi had.";s:12:"product_desc";s:969:"Ever since we came to know about the special and eternal power of mangekyo sharingan, we wanted one for ourself, but the icing on the cake was when we came to know about ''Kamui''. The special sharingan ability which can transfer people or best of all yourself to another dimension.<br><br>\r\nJust imagine being stuck with your boss or even gf/bf blabbering about this and that and poof! you are gone. Solves just so many of our problems, right?<br>\r\nWell, we are so excited to inform you that now you can actually own this power by wearing our kamui t shirt. We went to great lengths and put in a lot of effort to make sure this power comes to each and every one of us who has the will to awaken his/her mangekyo sharingan.<br><br>\r\nLet us know in the comments below which other powers/abilities you would like to gain and we will make sure to put them on our tees.<br><br>\r\nThis naruto anime t shirt is screen printed on a 100% cotton black colored psycho store t shirt.";s:18:"product_image_path";s:37:"images/product/23/kamui_sharingan.png";s:13:"product_price";s:3:"499";s:16:"product_qty_sold";s:1:"3";s:12:"product_date";s:19:"2016-09-10 02:48:49";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";s:15:"product_details";a:7:{s:9:"tshirt_id";s:1:"1";s:10:"product_id";s:2:"23";s:9:"small_qty";s:1:"5";s:10:"medium_qty";s:1:"4";s:9:"large_qty";s:2:"-1";s:6:"xl_qty";s:1:"5";s:13:"size_preorder";s:1:"0";}}i:1;a:15:{s:10:"product_id";s:2:"22";s:12:"product_type";s:6:"tshirt";s:12:"product_game";s:14:"Counter Strike";s:12:"product_name";s:21:"Invisble Wings Jersey";s:11:"product_url";s:59:"counter strike invisble wings official jersey t shirt india";s:13:"product_intro";s:77:"Show your support for team invisible wings, by wearing their official jersey.";s:12:"product_desc";s:772:"Team Invisible Wings literally came out of nowhere and has shook the Indian e-sports community with their continuous stellar performances and wins. <br>\r\nBacked by the awesome guys at <a href="http://tranzeneca.com/" target="_blank">Tranzeneca Gaming</a>, we are sure they will set the esports world on fire in the coming future.<br><br>\r\nMeanwhile show your support by sporting their killer looking official jersey.\r\n<br><br>\r\nNote : These orders are fulfilled by Invisible Wings themselves and not by Psycho Store, but you can rest assured about the quality.\r\n<br><br>\r\nInivisble Wings official jersey is made by using a delicate balance of cotton and polyster and is not 100% cotton like other psycho store tees.\r\n<br><br>\r\nLet us know your views in the comments below.";s:18:"product_image_path";s:23:"images/product/22/a.png";s:13:"product_price";s:3:"799";s:16:"product_qty_sold";s:1:"0";s:12:"product_date";s:19:"2016-08-28 23:52:25";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";s:15:"product_details";a:7:{s:9:"tshirt_id";s:1:"2";s:10:"product_id";s:2:"22";s:9:"small_qty";s:1:"5";s:10:"medium_qty";s:1:"5";s:9:"large_qty";s:1:"5";s:6:"xl_qty";s:1:"5";s:13:"size_preorder";s:1:"0";}}i:2;a:15:{s:10:"product_id";s:2:"21";s:12:"product_type";s:6:"tshirt";s:12:"product_game";s:7:"Pokemon";s:12:"product_name";s:16:"Being Charmander";s:11:"product_url";s:43:"being charmander pokemon anime sthirt india";s:13:"product_intro";s:141:"We shall not be held responsible if after wearing this pokemon t shirt you somehow evolve from charmander to chairzard and become a lazy bum.";s:12:"product_desc";s:847:"So it had been quite some time since we caught our first pokemon (pikachu) and we decided it was time to again go pokemon hunting. Turns out the luck was on our side and we managed to capture this beauty, yes charmander it is. After capturing this cute little fiery beast our scientists tried to mimic it''s tail, where in the flame on it''s tail indicates chamander''s emotions. We thought we might be able to do something similar, but alas our scientists were not capable enough.\r\n<br><br>\r\nSo we thought chuck it, we will just capture the happy emotions from charmander and infuse it into the t shirt and that is exactly what we did. So we assure you that after wearing this pokemon t shirt, happiness is the only emotion you will feel.\r\n<br><br>\r\nThis charmander pokemon tee is screen printed on a 100% cotton orange colored psycho store t shirt.";s:18:"product_image_path";s:32:"images/product/21/charmander.png";s:13:"product_price";s:3:"499";s:16:"product_qty_sold";s:1:"1";s:12:"product_date";s:19:"2016-08-23 03:43:04";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";s:15:"product_details";a:0:{}}i:3;a:15:{s:10:"product_id";s:2:"18";s:12:"product_type";s:6:"tshirt";s:12:"product_game";s:16:"Metal Gear Solid";s:12:"product_name";s:12:"Diamond Dogs";s:11:"product_url";s:50:"metal gear solid diamond dogs gaming t shirt india";s:13:"product_intro";s:70:"True diamond dogs wear this metal gear solid tee. Are you one of them?";s:12:"product_desc";s:605:"Do you remember the time which started the era of private military organisations and diamond dogs (1984 - 1995) was at the forefront of it who were willing to take up unsavory jobs for the clients but still at the same time always managed to maintain pride in their work. Not just this they were led by one of the most charismatic leader ever, the venom snake.<br><br>\r\nSo wear this tee with pride and show your support for those "dogs of war" and yes be a diamond dog yourself.<br><br>\r\nLet us know your views in the comments below. <br><br>\r\n\r\nScreen printed on a 100% cotton steel grey colored t shirt.";s:18:"product_image_path";s:23:"images/product/18/2.png";s:13:"product_price";s:3:"499";s:16:"product_qty_sold";s:1:"0";s:12:"product_date";s:19:"2016-04-08 01:12:13";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";s:15:"product_details";a:0:{}}}s:7:"user_id";s:2:"93";s:8:"username";s:25:"ishkaran.fearme@gmail.com";s:6:"status";s:1:"1";}');
