('a9dd1031fa4e70743dcedcae82ee00d2', '::1', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/55.0.2883.87 Safari/537.36', 1482960994, 'a:3:{s:9:"user_data";s:0:"";s:6:"events";N;s:15:"recently_viewed";a:3:{i:0;a:15:{s:10:"product_id";s:2:"23";s:12:"product_type";s:6:"tshirt";s:12:"product_game";s:6:"naruto";s:12:"product_name";s:24:"Kamui Mangekyo Sharnigan";s:11:"product_url";s:51:"kamui mangekyo sharnigan naruto anime t shirt india";s:13:"product_intro";s:148:"Wear this naruto inspired t shirt to awaken the mangekyo sharingan inside you and gain the special ability of kamui just like obito and kakashi had.";s:12:"product_desc";s:969:"Ever since we came to know about the special and eternal power of mangekyo sharingan, we wanted one for ourself, but the icing on the cake was when we came to know about ''Kamui''. The special sharingan ability which can transfer people or best of all yourself to another dimension.<br><br>\r\nJust imagine being stuck with your boss or even gf/bf blabbering about this and that and poof! you are gone. Solves just so many of our problems, right?<br>\r\nWell, we are so excited to inform you that now you can actually own this power by wearing our kamui t shirt. We went to great lengths and put in a lot of effort to make sure this power comes to each and every one of us who has the will to awaken his/her mangekyo sharingan.<br><br>\r\nLet us know in the comments below which other powers/abilities you would like to gain and we will make sure to put them on our tees.<br><br>\r\nThis naruto anime t shirt is screen printed on a 100% cotton black colored psycho store t shirt.";s:18:"product_image_path";s:37:"images/product/23/kamui_sharingan.png";s:13:"product_price";s:3:"499";s:16:"product_qty_sold";s:2:"17";s:12:"product_date";s:19:"2016-09-10 02:48:49";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";s:15:"product_details";a:7:{s:9:"tshirt_id";s:1:"1";s:10:"product_id";s:2:"23";s:9:"small_qty";s:1:"1";s:10:"medium_qty";s:1:"3";s:9:"large_qty";s:1:"3";s:6:"xl_qty";s:1:"2";s:13:"size_preorder";s:1:"0";}}i:1;a:15:{s:10:"product_id";s:2:"20";s:12:"product_type";s:6:"tshirt";s:12:"product_game";s:14:"Counter Strike";s:12:"product_name";s:19:"Loser Buy A Defuser";s:11:"product_url";s:55:"loser buy a defuser counter strike gaming t shirt india";s:13:"product_intro";s:134:"Dedicated to all those losers who never buy defusers. Always remember to wear this tee to a tournament as a reminder for you know who.";s:12:"product_desc";s:1880:"Based on real fictional events<br><br>\r\nIt was the dawn of the century where an epic battle that has been going for ages was about to come to an end. The balance of the force was about to be shifted to either of the side and it all rested on the capture of a very important and dusty camp site. Millions layed down their lives in their pursuit to capture that camp site. both sides suffered extreme losses, almost all of their global elites were nearing their ends. Just a handful of extremely elite ones remained along with some campers as well who were able to survive this long thanks to their noob camping skills. But there is indeed a thin line that even a noob camping guy should not cross and that is, trying to defuse a bomb without a defusal kit that too in the presence of global elites. Moreover if this particular bomb went off, it would have been an extremely heavy blow to their side.<br>\r\nThe guy defusing the bomb was reciting the prayer under his breath "In the name of the super saiyan god goku, the holy sons gohan and goten and the eternal dragon shenron'', please make this bomb defuse faster. Right then and there in the heat of the battle, a global elite made the right decision and gave a head shot to that guy, his own guy because he knew very well the consequences of the failure. he got to the bomb and defused it in a jiffy using the defusal kit and vowed to always wear a t shirt that would remind everyone not to act like that loser and to buy a defuser.<br><br>\r\nFast forward 30 years, peace has been restored to the valley and in rememberance of that fateful day, we are giving an opportunity to each and every one of you to wear this tee and remind the whole world around you to always and always buy a defuser.<br><br>\r\nLet us know your bomb defusal moments in the comments below. <br><br>\r\n\r\nScreen printed on a 100% cotton black colored t shirt.";s:18:"product_image_path";s:29:"images/product/20/defuser.png";s:13:"product_price";s:3:"499";s:16:"product_qty_sold";s:1:"0";s:12:"product_date";s:19:"2016-05-25 02:04:35";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:8:"preorder";s:7:"hashtag";s:12:"psychofamous";s:15:"product_details";a:0:{}}i:2;a:15:{s:10:"product_id";s:2:"22";s:12:"product_type";s:6:"tshirt";s:12:"product_game";s:14:"Counter Strike";s:12:"product_name";s:21:"Invisble Wings Jersey";s:11:"product_url";s:59:"counter strike invisble wings official jersey t shirt india";s:13:"product_intro";s:77:"Show your support for team invisible wings, by wearing their official jersey.";s:12:"product_desc";s:772:"Team Invisible Wings literally came out of nowhere and has shook the Indian e-sports community with their continuous stellar performances and wins. <br>\r\nBacked by the awesome guys at <a href="http://tranzeneca.com/" target="_blank">Tranzeneca Gaming</a>, we are sure they will set the esports world on fire in the coming future.<br><br>\r\nMeanwhile show your support by sporting their killer looking official jersey.\r\n<br><br>\r\nNote : These orders are fulfilled by Invisible Wings themselves and not by Psycho Store, but you can rest assured about the quality.\r\n<br><br>\r\nInivisble Wings official jersey is made by using a delicate balance of cotton and polyster and is not 100% cotton like other psycho store tees.\r\n<br><br>\r\nLet us know your views in the comments below.";s:18:"product_image_path";s:23:"images/product/22/a.png";s:13:"product_price";s:3:"799";s:16:"product_qty_sold";s:1:"5";s:12:"product_date";s:19:"2016-08-28 23:52:25";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";s:15:"product_details";a:7:{s:9:"tshirt_id";s:1:"2";s:10:"product_id";s:2:"22";s:9:"small_qty";s:1:"3";s:10:"medium_qty";s:1:"4";s:9:"large_qty";s:1:"5";s:6:"xl_qty";s:1:"4";s:13:"size_preorder";s:1:"0";}}}}'),
