";s:16:"product_qty_sold";s:2:"21";s:12:"product_date";s:19:"2016-09-10 02:48:49";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";s:14:"product_source";s:7:"inhouse";s:8:"featured";s:1:"1";s:8:"category";s:6:"Gaming";s:15:"product_details";a:7:{s:9:"tshirt_id";s:1:"1";s:10:"product_id";s:2:"23";s:9:"small_qty";s:1:"1";s:10:"medium_qty";s:1:"2";s:9:"large_qty";s:1:"0";s:6:"xl_qty";s:1:"2";s:13:"size_preorder";s:1:"0";}}i:2;a:19:{s:10:"product_id";s:2:"21";s:12:"product_type";s:6:"tshirt";s:9:"design_id";s:2:"11";s:12:"product_game";s:7:"Pokemon";s:12:"product_name";s:16:"Being Charmander";s:11:"product_url";s:43:"being charmander pokemon anime sthirt india";s:13:"product_intro";s:141:"We shall not be held responsible if after wearing this pokemon t shirt you somehow evolve from charmander to chairzard and become a lazy bum.";s:12:"product_desc";s:847:"So it had been quite some time since we caught our first pokemon (pikachu) and we decided it was time to again go pokemon hunting. Turns out the luck was on our side and we managed to capture this beauty, yes charmander it is. After capturing this cute little fiery beast our scientists tried to mimic it''s tail, where in the flame on it''s tail indicates chamander''s emotions. We thought we might be able to do something similar, but alas our scientists were not capable enough.\r\n<br><br>\r\nSo we thought chuck it, we will just capture the happy emotions from charmander and infuse it into the t shirt and that is exactly what we did. So we assure you that after wearing this pokemon t shirt, happiness is the only emotion you will feel.\r\n<br><br>\r\nThis charmander pokemon tee is screen printed on a 100% cotton orange colored psycho store t shirt.";s:18:"product_image_path";s:31:"images/product/21/bulbasaur.png";s:13:"product_price";s:3:"499";s:16:"product_qty_sold";s:1:"4";s:12:"product_date";s:19:"2016-08-23 03:43:04";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";s:14:"product_source";s:7:"inhouse";s:8:"featured";s:1:"0";s:8:"category";s:6:"Gaming";s:15:"product_details";a:7:{s:9:"tshirt_id";s:1:"3";s:10:"product_id";s:2:"21";s:9:"small_qty";s:1:"5";s:10:"medium_qty";s:1:"2";s:9:"large_qty";s:1:"5";s:6:"xl_qty";s:1:"5";s:13:"size_preorder";s:1:"0";}}i:3;a:19:{s:10:"product_id";s:2:"25";s:12:"product_type";s:6:"tshirt";s:9:"design_id";s:2:"25";s:12:"product_game";s:7:"Pokemon";s:12:"product_name";s:8:"Bulbaaaa";s:11:"product_url";s:37:"bulbasaur pokemon anime t shirt india";s:13:"product_intro";s:86:"Somethings achieve evergreen status, for others here''s this bulbasaur pokemon t shirt.";s:12:"product_desc";s:957:"The same time when I realized that I need a water pokemon t-shirt (read the product description of squirtle tee if you still haven''t http://bit.ly/2layNL2 ), I thought hey why not get bulbasaur also, so that I can also rest in natural shade whenever I want to. I mean if i am gonna get some water pokemon then better to get both at once and not to keep on pestering ash ketchum again and again.<br><br>\r\nSo here we are to satisfy all your green needs (pun intended)<br>\r\nYes, I did get my scientists to inject organic greenry for our pot lover friends in this tee. yes I can hear you screaming with joy over the analytics screen<br>\r\nYou can always thank me later after you get the tee.<br><br>\r\nNote : Don''t believe everything you read on the internet.<br><br>\r\nLet us know in the comments below which other pokemons you want to keep in your closet.<br><br>\r\nThis pokemon anime t shirt is screen printed on a 100% cotton green colored psycho store t shirt.";s:18:"product_image_path";s:31:"images/product/25/bulbasaur.png";s:13:"product_price";s:3:"499";s:16:"product_qty_sold";s:1:"0";s:12:"product_date";s:19:"2017-02-16 14:14:25";s:19:"add_to_cart_comment