('c2511131dd39d0e802906c438c31d413', '::1', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/48.0.2564.109 Safari/537.36', 1455401165, 'a:8:{s:9:"user_data";s:0:"";s:7:"user_id";s:2:"66";s:8:"username";s:25:"ishkaran.fearme@gmail.com";s:6:"status";s:1:"1";s:6:"events";N;s:15:"recently_viewed";a:4:{i:0;a:17:{s:10:"product_id";s:2:"12";s:12:"product_type";s:6:"Tshirt";s:12:"product_game";s:13:"Dragon ball z";s:12:"product_name";s:11:"Goku symbol";s:11:"product_url";s:37:"dragon ball z anime goku tshirt india";s:13:"product_intro";s:27:"kaa-mee-haa-mee-haaaaaaa !!";s:12:"product_desc";s:1275:"We were actually going to make a Goku dogi first, but we thought a tshirt would be much better for your wardrobe.<br> So wear this with pride and show off the fact that you are a distinguished warrior who underwent training from both master Roshi and King Kai, mastering in techniques like kamehameha, spirit bomb and kaio-ken.<br>\r\nBut never ever forget, what these symbols actually stand for, remember what goku taught us in the childhood, to never give up in the face of adversties, to always believe in yourself, to always have faith in yourself and always fight for whats right and stand against injustice.\r\nMost importantly never forget that you can achieve any level and overcome any obstacle, given that you are ready to put in the required effort to achieve it.<br>\r\nI dont think we need to tell you what your power level will be after wearing this tshirt, so wear this and we assure you that you will be able to face any damn thing in your life.\r\n<br><br>\r\nNote : Please dont come complaining back to us if you cant shoot energy beams through your hands, or if nothing happens when you shout kamehameha, be realistic guys, its just a t shirt after all.\r\n<br><br>\r\nLet us know your views in the comments below.\r\n<br><br>Screen printed on a 100% cotton orange tshirt.";s:18:"product_image_path";s:15:"images/goku.png";s:13:"product_price";s:3:"600";s:19:"product_count_small";s:1:"0";s:20:"product_count_medium";s:1:"8";s:19:"product_count_large";s:2:"10";s:16:"product_count_xl";s:2:"10";s:16:"product_qty_sold";s:2:"32";s:12:"product_date";s:19:"2014-12-09 01:13:46";s:19:"add_to_cart_comment";s:41:"Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";}i:1;a:17:{s:10:"product_id";s:2:"14";s:12:"product_type";s:6:"Tshirt";s:12:"product_game";s:13:"One Punch man";s:12:"product_name";s:3:"OK.";s:11:"product_url";s:36:"one punch man ok anime t shirt india";s:13:"product_intro";s:111:"We can''t give you saitama''s powers, but his attitude is the closest thing that you can get by wearing this tee.";s:12:"product_desc";s:648:"We tried a lot to make a t shirt that would grant you saitama''s powers, but unfortunately our scientists couldn''t crack the code for that, but it''s not like that we have given up on it, believe us our scientists are still working on it. Meantime we came up with this innovative t shirt to give you a taste of saitama''s attitude towards life and especially problems. So however grave and dismal the situation be all you need to do is wear this t shirt and say ok and believe us its gonna be all right.<br><br>\r\nLet us know your views of your ok moments in the comments below. <br><br>\r\n\r\nScreen printed on a 100% cotton golden yellow colored tshirt.";s:18:"product_image_path";s:23:"images/product/14/1.png";s:13:"product_price";s:3:"599";s:19:"product_count_small";s:1:"8";s:20:"product_count_medium";s:2:"20";s:19:"product_count_large";s:2:"19";s:16:"product_count_xl";s:2:"20";s:16:"product_qty_sold";s:2:"13";s:12:"product_date";s:19:"2015-02-01 02:32:14";s:19:"add_to_cart_comment";s:41:"Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";}i:2;a:18:{s:10:"product_id";s:2:"11";s:12:"product_type";s:6:"Tshirt";s:12:"product_game";s:12:"Breaking Bad";s:12:"product_name";s:6:"Bender";s:11:"product_url";s:39:"breaking bad gaming bender tshirt india";s:13:"