('ca21256e23e363e92e22b75eb5940b26', '::1', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/51.0.2704.84 Safari/537.36', 1466070921, 'a:9:{s:9:"user_data";s:0:"";s:6:"events";N;s:7:"user_id";s:2:"66";s:8:"username";s:25:"ishkaran.fearme@gmail.com";s:6:"status";s:1:"1";s:15:"recently_viewed";a:2:{i:0;a:19:{s:10:"product_id";s:2:"19";s:12:"product_type";s:6:"Tshirt";s:12:"product_game";s:7:"Pokemon";s:12:"product_name";s:12:"Pikachu Face";s:11:"product_url";s:40:"pikachu face pokemon anime t shirt india";s:13:"product_intro";s:119:"Wear this tee and get ready to hear people around you yell "I chose you Pikachu". Also don''t forget to say "Pika Pika".";s:12:"product_desc";s:1373:"When we first got the challenge of creating a tee inspired from the legendary anime pokemon, we knew it wasn''t an easy task. Yes, obviously we can create a yet another pokemon tee, but we wanted you guys to actually feel that particular pokemon''s power run through your blood, when wearing that pokemon''s tee and we knew for that, we will need help from the one and only <a target="_blank" href="http://pokemon.wikia.com/wiki/Ash_Ketchum">Ash Ketchum</a>.<br><br>\r\nIt was tough but finally our satellites were able to track him down, we wasted no time in reaching him and told him of our situation, that we wanted to create a pikachu inspired tee which after wearing, should give people the ability to use <a target="_blank" href="http://pokemon.wikia.com/wiki/Thunderbolt">thunderbolt</a> attack and the special <a target="_blank" href="http://pokemon.wikia.com/wiki/Static">static</a> ability. <br><br>\r\nThough it took some convincing but our marketing team (special bonus for them this year) was able to woo him into letting our scientists take some dna samples from pikachu which they then infused with the t-shirt material from which this epic tee is created.<br><br>\r\nNote : Please don''t believe everything you read on the internet.<br><br>\r\nLet us know which other pokemons would you love to catch. <br><br>\r\n\r\nScreen printed on a 100% cotton yellow colored t shirt.";s:18:"product_image_path";s:27:"images/product/19/pika2.png";s:13:"product_price";s:3:"499";s:19:"product_count_small";s:1:"5";s:20:"product_count_medium";s:1:"5";s:19:"product_count_large";s:1:"4";s:16:"product_count_xl";s:1:"5";s:16:"product_qty_sold";s:1:"2";s:12:"product_date";s:19:"2016-04-11 19:41:39";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:8:"preorder";s:7:"hashtag";s:12:"psychofamous";s:13:"size_preorder";s:1:"1";}i:1;a:19:{s:10:"product_id";s:2:"20";s:12:"product_type";s:6:"Tshirt";s:12:"product_game";s:14:"Counter Strike";s:12:"product_name";s:20:"Loser, Buy A Defuser";s:11:"product_url";s:55:"loser buy a defuser counter strike gaming t shirt india";s:13:"product_intro";s:134:"Dedicated to all those losers who never buy defusers. Always remember to wear this tee to a tournament as a reminder for you know who.";s:12:"product_desc";s:1880:"Based on real fictional events<br><br>\r\nIt was the dawn of the century where an epic battle that has been going for ages was about to come to an end. The balance of the force was about to be shifted to either of the side and it all rested on the capture of a very important and dusty camp site. Millions layed down their lives in their pursuit to capture that camp site. both sides suffered extreme losses, almost all of their global elites were nearing their ends. Just a handful of extremely elite ones remained along with some campers as well who were able to survive this long thanks to their noob camping skills. But there is indeed a thin line that even a noob camping guy should not cross and that is, trying to defuse a bomb without a defusal kit that too in the presence of global elites. Moreover if this particular bomb went off, it would have been an extremely heavy blow to their side.<br>\r\nThe guy defusing the bomb was reciting the prayer under his breath "In the name of the super saiyan god goku, the holy sons gohan and goten and the eternal dragon shenron'', please make this bomb defuse faster. Right then and there in the heat of the battle, a global elite made the right decision and gave a head shot to that guy, his own guy because he knew very well the consequences of the failure. he got to the bomb and defused it in a jiffy using the defusal kit and vowed to always wear a t shirt that would remind everyone not to act like that loser and to buy a defuser.<br><br>\r\nFast forward 30 years, peace has been restored to the valley and in rememberance of that fateful day, we are giving an opportunity to each and every one of you to wear this tee and remind the whole world around you to always and always buy a defuser.<br><br>\r\nLet us know your bomb defusal moments in the comments below. <br><br>\r\n\r\nScreen printed on a 100% cotton black colored t shirt.";s:18:"product_image_path";s:29:"images/product/20/defuser.png";s:13:"product_price";s:3:"499";s:19:"product_count_small";s:1:"5";s:20:"product_count_medium";s:1:"5";s:19:"product_count_large";s:1:"5";s:16:"product_count_xl";s:1:"5";s:16:"product_qty_sold";s:1:"0";s:12:"product_date";s:19:"2016-05-25 02:04:35";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:8:"preorder";s:7:"hashtag";s:12:"psychofamous";s:13:"size_preorder";s:1:"0";}}s:13:"cart_contents";a:4:{s:32:"bb0266a545f908d26e8a28b770144c0b";a:7:{s:5:"rowid";s:32:"bb0266a545f908d26e8a28b770144c0b";s:2:"id";s:2:"20";s:3:"qty";s:1:"1";s:5:"price";s:3:"499";s:4:"name";s:19:"Loser Buy A Defuser";s:7:"options";a:1:{s:4:"Size";s:6:"Medium";}s:8:"subtotal";i:499;}s:11:"total_items";i:1;s:10:"cart_total";i:499;s:11:"final_price";d:499;}s:8:"discount";a:2:{s:10:"percentage";i:0;s:6:"coupon";N;}s:6:"txn_id";s:8:"576276e6";}'),
