('caa774068da4e4b6422bdb3b43c4e868', '::1', 'Mozilla/5.0 (iPad; CPU OS 9_1 like Mac OS X) AppleWebKit/601.1.46 (KHTML, like Gecko) Version/9.0 Mobile/13B137 Safari/6', 1457426856, 'a:3:{s:9:"user_data";s:0:"";s:6:"events";N;s:15:"recently_viewed";a:1:{i:0;a:18:{s:10:"product_id";s:2:"16";s:12:"product_type";s:6:"Tshirt";s:12:"product_game";s:13:"The Witcher 3";s:12:"product_name";s:20:"Witcher 3 White Wolf";s:11:"product_url";s:41:"witcher 3 white wolf gaming t shirt india";s:13:"product_intro";s:113:"Get your hands on this witcher inspired tee, before you go wandering into the jungle in search of those monsters.";s:12:"product_desc";s:816:"We were really thrilled to hear that our team finally got the chance to interview the legendary monster hunter Geralt Of Rivia aka White Wolf. We really wanted to know the secret behind his speed and reflexes and to our surprise he actually gave us some magical substances to get the taste of his powers firsthand. Our scientists were hard at work for past 6 months to figure out a way to infuse those substances in the t shirts itself so that all our fans can taste Geralt''s powers. <br><br>\r\nSo here you go guys, after shit load of hardwork we present to you this magical tee infused with white wolf''s power and abilities so that even you can enjoy monster hunting now.\r\n<br><br>\r\nLet us know your monster hunting experiences in the comments below. <br><br>\r\n\r\nScreen printed on a 100% cotton black colored tshirt.";s:18:"product_image_path";s:23:"images/product/16/1.png";s:13:"product_price";s:3:"499";s:19:"product_count_small";s:1:"4";s:20:"product_count_medium";s:1:"5";s:19:"product_count_large";s:1:"5";s:16:"product_count_xl";s:1:"5";s:16:"product_qty_sold";s:1:"1";s:12:"product_date";s:19:"2016-02-25 17:28:21";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";}}}'),
