('ce60e52557398f3de7472a9649adffbf', '::1', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/48.0.2564.116 Safari/537.36', 1457803260, 'a:8:{s:6:"events";N;s:15:"recently_viewed";a:5:{i:0;a:18:{s:10:"product_id";s:2:"12";s:12:"product_type";s:6:"Tshirt";s:12:"product_game";s:13:"Dragon ball z";s:12:"product_name";s:11:"Goku symbol";s:11:"product_url";s:37:"dragon ball z anime goku tshirt india";s:13:"product_intro";s:27:"kaa-mee-haa-mee-haaaaaaa !!";s:12:"product_desc";s:1275:"We were actually going to make a Goku dogi first, but we thought a tshirt would be much better for your wardrobe.<br> So wear this with pride and show off the fact that you are a distinguished warrior who underwent training from both master Roshi and King Kai, mastering in techniques like kamehameha, spirit bomb and kaio-ken.<br>\r\nBut never ever forget, what these symbols actually stand for, remember what goku taught us in the childhood, to never give up in the face of adversties, to always believe in yourself, to always have faith in yourself and always fight for whats right and stand against injustice.\r\nMost importantly never forget that you can achieve any level and overcome any obstacle, given that you are ready to put in the required effort to achieve it.<br>\r\nI dont think we need to tell you what your power level will be after wearing this tshirt, so wear this and we assure you that you will be able to face any damn thing in your life.\r\n<br><br>\r\nNote : Please dont come complaining back to us if you cant shoot energy beams through your hands, or if nothing happens when you shout kamehameha, be realistic guys, its just a t shirt after all.\r\n<br><br>\r\nLet us know your views in the comments below.\r\n<br><br>Screen printed on a 100% cotton orange tshirt.";s:18:"product_image_path";s:15:"images/goku.png";s:13:"product_price";s:3:"600";s:19:"product_count_small";s:1:"0";s:20:"product_count_medium";s:1:"8";s:19:"product_count_large";s:2:"10";s:16