('d6246b58b930c84bd8b0b19e0941cb2a', '::1', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/50.0.2661.102 Safari/537.36', 1465323846, 'a:9:{s:9:"user_data";s:0:"";s:6:"events";N;s:15:"recently_viewed";a:6:{i:0;a:19:{s:10:"product_id";s:2:"19";s:12:"product_type";s:6:"Tshirt";s:12:"product_game";s:15:"Attack On Titan";s:12:"product_name";s:18:"Dawn Of The Titans";s:11:"product_url";s:40:"dawn attack on titan anime t shirt india";s:13:"product_intro";s:193:"The greatest threat humanity has ever faced is now printed on a tee for you to wear and acknowledge the fact that the end might be near or maybe not, we will soon find out in the second season.";s:12:"product_desc";s:1198:"So there I was sitting in a corner (that is where my bed is, nothing special there), alone in my flat with all lights switched off and my head phones on (that is how I like to watch horror movies), watching George A. Romero''s cult classic <a target ="_blank" href="http://www.imdb.com/title/tt0077402/">Dawn Of The Dead</a>. All of a sudden there was some vibration around me, I suddenly jumped a bit but later realized that it was just a message on my mobile (fb messanger), from a friend of mine. after some customary cursing to him, I saw that he had sent me a link to an anime that he has been watching named "Attack on Titan" and he was all praises for it. \r\n<br><br>\r\nthis my friends is the story of how this design came to be. Enjoy an epic mashup of a genre defining movie and an anime. Wear it with pride and more importantly wear it for the cause that Eren, Levi, Mikasa and many others believe in, wear it to show your support for the humanity and acknowledge the fact that titans are the most fearsome creatures ever faced by the humanity (in your face zombies).\r\n<br><br>\r\nLet us know your views in the comments below. <br><br>\r\n\r\nScreen printed on a 100% cotton black colored t shirt.";s:18:"product_image_path";s:31:"images/product/19/balbasaur.png";s:13:"product_price";s:3:"499";s:19:"product_count_small";s:2:"-1";s:20:"product_count_medium";s:1:"5";s:19:"product_count_large";s:1:"4";s:16:"product_count_xl";s:1:"5";s:16:"product_qty_sold";s:1:"2";s:12:"product_date";s:19:"2016-04-11 19:41:39";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";s:13:"size_preorder";s:1:"1";}i:1;a:19:{s:10:"product_id";s:2:"14";s:12:"product_type";s:6:"Tshirt";s:12:"product_game";s:13:"One Punch man";s:12:"product_name";s:3:"OK.";s:11:"product_url";s:36:"one punch man ok anime t shirt india";s:13:"product_intro";s:111:"We can''t give you saitama''s powers, but his attitude is the closest thing that you can get by wearing this tee.";s:12:"product_desc";s:648:"We tried a lot to make a t shirt that would grant you saitama''s powers, but unfortunately our scientists couldn''t crack the code for that, but it''s not like that we have given up on it, believe us our scientists are still working on it. Meantime we came up with this innovative t shirt to give you a taste of saitama''s attitude towards life and especially problems. So however grave and dismal the situation be all you need to do is wear this t shirt and say ok and believe us its gonna be all right.<br><br>\r\nLet us know your views of your ok moments in the comments below. <br><br>\r\n\r\nScreen printed on a 100% cotton golden yellow colored tshirt.";s:18:"product_image_path";s:23:"images/product/14/1.png";s:13:"product_price";s:3:"599";s:19:"product_count_small";s:1:"8";s:20:"product_count_medium";s:2:"20";s:19:"product_count_large";s:2:"19";s:16:"product_count_xl";s:2:"20";s:16:"product_qty_sold";s:2:"13";s:12:"product_date";s:19:"2015-02-01 02:32:14";s:19:"add_to_cart_comment";s:41:"Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychospower";s:13:"size_preorder";s:1:"0";}i:2;a:19:{s:10:"product_id";s:2:"18";s:12:"product_type";s:6:"Tshirt";s:12:"product_game";s:16:"Metal Gear Solid";s:12:"product_name";s:12:"Diamond Dogs";s:11:"product_url";s:50:"metal gear solid diamond dogs gaming t shirt india";s:13:"product_intro";s:70:"True diamond dogs wear this metal gear solid tee. Are you one of them?";s:12:"product_desc";s:605:"Do you remember the time which started the era of private military organisations and diamond dogs (1984 - 1995) was at the forefront of it who were willing to take up unsavory jobs for the clients but still at the same time always managed to maintain pride in their work. Not just this they were led by one of the most charismatic leader ever, the venom snake.<br><br>\r\nSo wear this tee with pride and show your support for those "dogs of war" and yes be a diamond dog yourself.<br><br>\r\nLet us know your views in the comments below. <br><br>\r\n\r\nScreen printed on a 100% cotton steel grey colored t shirt.";s:18:"product_image_path";s:23:"images/product/18/2.png";s:13:"product_price";s:3:"499";s:19:"product_count_small";s:1:"5";s:20:"product_count_medium";s:1:"5";s:19:"product_count_large";s:1:"5";s:16:"product_count_xl";s:1:"5";s:16:"product_qty_sold";s:1:"0";s:12:"product_date";s:19:"2016-04-08 01:12:13";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:8:"preorder";s:7:"hashtag";s:12:"psychofamous";s:13:"size_preorder";s:1:"0";}i:3;a:19:{s:10:"product_id";s:2:"20";s:12:"product_type";s:6:"Tshirt";s:12:"product_game";s:14:"Counter Strike";s:12:"product_name";s:13:"Buy A Defuser";s:11:"product_url";s:54:"loser buy a defuser counter strike gaming tshirt india";s:13:"product_intro";s:13:"Loser Defusar";s:12:"product_desc";s:13:"Loser Defusar";s:18:"product_image_path";s:29:"images/product/20/defuser.png";s:13:"product_price";s:3:"499";s:19:"product_count_small";s:1:"5";s:20:"product_count_medium";s:1:"5";s:19:"product_count_large";s:1:"5";s:16:"product_count_xl";s:1:"5";s:16:"product_qty_sold";s:1:"0";s:12:"product_date";s:19:"2016-05-25 02:04:35";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";s:13:"size_preorder";s:1:"0";}i:4;a:19:{s:10:"product_id";s:2:"13";s:12:"product_type";s:6:"Tshirt";s:12:"product_game";s:7:"Fallout";s:12:"product_name";s:19:"Fallout : Nuka Cola";s:11:"product_url";s:37:"nuka cola fallout gaming tshirt india";s:13:"product_intro";s:135:"The most popular drink of the wasteland, now printed on a t shirt for you to wear and show your support for the post apocalyptic world.";s:12:"product_desc";s:796:"We have utmost respect for <a target="_blank" href="http://fallout.wikia.com/wiki/John-Caleb_Bradberton">John-Caleb Bradberton</a> for inventing the most popular soft drink ever. Even after the great war, nuka cola remains the #1 drink of the post apocalyptic world. Even their bottle caps can be seen being used as a currency in the new world. <br>\r\nSince everyone knows the fact that "War, War never changes", we bring to you the ice cold version of this drink for you to chill and deal with the fact.\r\n<br><br>Wear this t shirt and pay your tribute to one of the best rpg game ever made, that has been training you for years in case an apocalyptic situation arises.\r\n<br><br>\r\nLet us know your best nuka cola moments in the comments below. <br><br>\r\nScreen printed on a 100% cotton red tshirt.";s:18:"product_image_path";s:23:"images/product/13/1.png";s:13:"product_price";s:3:"600";s:19:"product_count_small";s:1:"0";s:20:"product_count_medium";s:2:"15";s:19:"product_count_large";s:2:"19";s:16:"product_count_xl";s:1:"6";s:16:"product_qty_sold";s:2:"20";s:12:"product_date";s:19:"2014-12-09 01:13:46";s:19:"add_to_cart_comment";s:41:"Wear this on a first date, you will rock.";s:13:"product_state";s:8:"preorder";s:7:"hashtag";s:12:"psychofamous";s:13:"size_preorder";s:1:"0";}i:5;a:19:{s:10:"product_id";s:2:"12";s:12:"product_type";s:6:"Tshirt";s:12:"product_game";s:13:"Dragon ball z";s:12:"product_name";s:11:"Goku symbol";s:11:"product_url";s:37:"dragon ball z anime goku tshirt india";s:13:"product_intro";s:27:"kaa-mee-haa-mee-haaaaaaa !!";s:12:"product_desc";s:1275:"We were actually going to make a Goku dogi first, but we thought a tshirt would be much better for your wardrobe.<br> So wear this with pride and show off the fact that you are a distinguished warrior who underwent training from both master Roshi and King Kai, mastering in techniques like kamehameha, spirit bomb and kaio-ken.<br>\r\nBut never ever forget, what these symbols actually stand for, remember what goku taught us in the childhood, to never give up in the face of adversties, to always believe in yourself, to always have faith in yourself and always fight for whats right and stand against injustice.\r\nMost importantly never forget that you can achieve any level and overcome any obstacle, given that you are ready to put in the required effort to achieve it.<br>\r\nI dont think we need to tell you what your power level will be after wearing this tshirt, so wear this and we assure you that you will be able to face any damn thing in your life.\r\n<br><br>\r\nNote : Please dont come complaining back to us if you cant shoot energy beams through your hands, or if nothing happens when you shout kamehameha, be realistic guys, its just a t shirt after all.\r\n<br><br>\r\nLet us know your views in the comments below.\r\n<br><br>Screen printed on a 100% cotton orange tshirt.";s:18:"product_image_path";s:15:"images/goku.png";s:13:"product_price";s:3:"600";s:19:"product_count_small";s:1:"0";s:20:"product_count_medium";s:1:"8";s:19:"product_count_large";s:2:"10";s:16:"product_count_xl";s:2:"10";s:16:"product_qty_sold";s:2:"32";s:12:"product_date";s:19:"2014-12-09 01:13:46";s:19:"add_to_cart_comment";s:41:"Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";s:13:"size_preorder";s:1:"0";}}s:13:"c