('d828b7a10a59b4a00ebd4a523b3b59ae', '::1', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/57.0.2987.133 Safari/537.36', 1494400877, 'a:6:{s:9:"user_data";s:0:"";s:6:"events";N;s:15:"recently_viewed";a:6:{i:0;a:18:{s:10:"product_id";s:1:"3";s:12:"product_type";s:4:"mugs";s:9:"design_id";s:1:"9";s:12:"product_game";s:7:"Pokemon";s:12:"product_name";s:16:"Get Sherlocked !";s:11:"product_url";s:40:"half life 2 gaming tshirt sherlock india";s:13:"product_intro";s:25:"Buy this awesome product.";s:12:"product_desc";s:280:"Remember that invincible feeling that you felt on getting S power. The feeling that there''s no stopping you, that you can now destroy any damn enemy in this world. Wear this s power tshirt in real life and be invincible.<br><br><br>Screen Printed on a black 180 gsm cotton tshirt.";s:18:"product_image_path";s:23:"images/product/3/dp.png";s:13:"product_price";s:3:"600";s:16:"product_qty_sold";s:2:"19";s:12:"product_date";s:19:"2014-12-09 01:13:46";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";s:14:"product_source";s:12:"dropshipping";s:8:"featured";s:1:"1";s:15:"product_details";N;}i:1;a:18:{s:10:"product_id";s:1:"4";s:12:"product_type";s:4:"mugs";s:9:"design_id";s:2:"24";s:12:"product_game";s:7:"Pokemon";s:12:"product_name";s:15:"Join the club !";s:11:"product_url";s:35:"dead space gaming tshirt club india";s:13:"product_intro";s:25:"Buy this awesome product.";s:12:"product_desc";s:14:"This is Sparta";s:18:"product_image_path";s:26:"images/product/4/right.png";s:13:"product_price";s:3:"500";s:16:"product_qty_sold";s:2:"16";s:12:"product_date";s:19:"2014-12-09 01:13:46";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";s:14:"product_source";s:12:"dropshipping";s:8:"featured";s:1:"0";s:15:"product_details";N;}i:2;a:18:{s:10:"product_id";s:2:"29";s:12:"product_type";s:6:"tshirt";s:9:"design_id";s:1:"0";s:12:"product_game";s:9:"Overwatch";s:12:"product_name";s:11:"Die Die Die";s:11:"product_url";s:43:"reaper walks overwatch gaming t shirt india";s:13:"product_intro";s:185:"Watch everyone around you run for cover as you walk around like death, wearing this overwatch reaper t shirt. Just don''t start yelling die, die, die yourself, let reaper do the talking.";s:12:"product_desc";s:1913:"I still remember it like it happened just few minutes back. I was totally engrossed in programming when I heard that loud thud in my living room, it was 3 am in the night. It was pretty strange but still I went to see what was happening and to my astonishment I saw reaper standing there, like actually standing right in front of me. I was literally dumbfound and didn''t know how to react as I had played reaper before but he was not my first choice. But never imagined that it would bring him to me in reality. <br><br>\r\nReaper : "I heard you are launching a new overwatch inspired t shirt?"<br>\r\nMe : "Wow! we didn''t knew we were so famous among overwatch heroes."<br>\r\nReaper : "Can I know which hero are you chosing first?"<br>\r\nMe : "Well honestly I am thinking of going with tracer since shes everyone''s heartthrob."<br>\r\nReaper : "I kneeeeeew it! You wouldn''t chose me. Anyway  I have a confession to make. I might come of as a really dark and strong character which I am btw, without a doubt. But still honestly I am also pretty soft at heart and I want you guys to help me change people''s perception of me by launching a cute but yet a strong design of mine."<br>\r\nMe : "Well, this actually sounds like a nice idea, I guess tracer can wait a bit. We can do this for you."<br>\r\nReaper : "Good, I will be looking forward to it and btw don''t forget to add my favorite line"<br>\r\nMe : "Die! Die! Die!"<br><br>\r\nSo here we are, finally fulfilling our promise to reaper who btw made us change the design n no. of times (hence the delay in launch). Believe us guys he is actually pretty soft at heart once he stops yelling.<br><br>\r\nDesign By <a href="https://www.facebook.com/cerinius/" target="_blank"> Anwesha Pradhan.</a><br><br>\r\nLet us know which hero you want us to design next.<br><br>\r\nThis overwatch inspired gaming t shirt is digitally printed on a 100% cotton turquoise colored psycho store t shirt.";s:18:"product_image_path";s:38:"images/product/29/overwatch_reaper.png";s:13:"product_price";s:3:"599";s:16:"product_qty_sold";s:1:"3";s:12:"product_date";s:19:"2017-04-03 01:44:47";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";s:14:"product_source";s:7:"inhouse";s:8:"featured";s:1:"1";s:15:"product_details";a:7:{s:9:"tshirt_id";s:2:"31";s:10:"product_id";s:2:"29";s:9:"small_qty";s:1:"5";s:10:"medium_qty";s:1:"2";s:9:"large_qty";s:1:"5";s:6:"xl_qty";s:1:"5";s:13:"size_preorder";s:1:"0";}}i:3;a:18:{s:10:"product_id";s:1:"5";s:12:"product_type";s:6:"tshirt";s:9:"design_id";s:1:"6";s:12:"product_game";s:7:"Witcher";s:12:"product_name";s:17:"Which dog are you";s:11:"product_url";s:31:"witcher gaming tshirt dog india";s:13:"product_intro";s:25:"Buy this awesome product.";s:12:"product_desc";s:0:"";s:18:"product_image_path";s:24:"images/reservoirdogs.png";s:13:"product_price";s:3:"600";s:16:"product_qty_sold";s:2:"22";s:12:"product_date";s:19:"2014-12-09 01:13:46";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";s:14:"product_source";s:7:"inhouse";s:8:"featured";s:1:"0";s:15:"product_details";a:7:{s:9:"tshirt_id";s:2:"18";s:10:"product_id";s:1:"5";s:9:"small_qty";s:1:"5";s:10:"medium_qty";s:1:"5";s:9:"large_qty";s:1:"5";s:6:"xl_qty";s:1:"5";s:13:"size_preorder";s:1:"0";}}i:4;a:18:{s:10:"product_id";s:2:"32";s:12:"product_type";s:6:"ts