('da840cbb200339f260360ec55bd7123a', '::1', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/57.0.2987.133 Safari/537.36', 1493060187, 'a:9:{s:9:"user_data";s:0:"";s:6:"events";N;s:15:"recently_viewed";a:6:{i:0;a:17:{s:10:"product_id";s:2:"29";s:12:"product_type";s:6:"tshirt";s:9:"design_id";s:1:"0";s:12:"product_game";s:9:"Overwatch";s:12:"product_name";s:11:"Die Die Die";s:11:"product_url";s:43:"reaper walks overwatch gaming t shirt india";s:13:"product_intro";s:185:"Watch everyone around you run for cover as you walk around like death, wearing this overwatch reaper t shirt. Just don''t start yelling die, die, die yourself, let reaper do the talking.";s:12:"product_desc";s:1913:"I still remember it like it happened just few minutes back. I was totally engrossed in programming when I heard that loud thud in my living room, it was 3 am in the night. It was pretty strange but still I went to see what was happening and to my astonishment I saw reaper standing there, like actually standing right in front of me. I was literally dumbfound and didn''t know how to react as I had played reaper before but he was not my first choice. But never imagined that it would bring him to me in reality. <br><br>\r\nReaper : "I heard you are launching a new overwatch inspired t shirt?"<br>\r\nMe : "Wow! we didn''t knew we were so famous among overwatch heroes."<br>\r\nReaper : "Can I know which hero are you chosing first?"<br>\r\nMe : "Well honestly I am thinking of going with tracer since shes everyone''s heartthrob."<br>\r\nReaper : "I kneeeeeew it! You wouldn''t chose me. Anyway  I have a confession to make. I might come of as a really dark and strong character which I am btw, without a doubt. But still honestly I am also pretty soft at heart and I want you guys to help me change people''s perception of me by launching a cute but yet a strong design of mine."<br>\r\nMe : "Well, this actually sounds like a nice idea, I guess tracer can wait a bit. We can do this for you."<br>\r\nReaper : "Good, I will be looking forward to it and btw don''t forget to add my favorite line"<br>\r\nMe : "Die! Die! Die!"<br><br>\r\nSo here we are, finally fulfilling our promise to reaper who btw made us change the design n no. of times (hence the delay in launch). Believe us guys he is actually pretty soft at heart once he stops yelling.<br><br>\r\nDesign By <a href="https://www.facebook.com/cerinius/" target="_blank"> Anwesha Pradhan.</a><br><br>\r\nLet us know which hero you want us to design next.<br><br>\r\nThis overwatch inspired gaming t shirt is digitally printed on a 100% cotton turquoise colored psycho store t shirt.";s:18:"product_image_path";s:38:"images/product/29/overwatch_reaper.png";s:13:"product_price";s:3:"599";s:16:"product_qty_sold";s:1:"0";s:12:"product_date";s:19:"2017-04-03 01:44:47";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";s:14:"product_source";s:7:"inhouse";s:15:"product_details";a:7:{s:9:"tshirt_id";s:2:"31";s:10:"product_id";s:2:"29";s:9:"small_qty";s:1:"5";s:10:"medium_qty";s:1:"5";s:9:"large_qty";s:1:"5";s:6:"xl_qty";s:1:"5";s:13:"size_preorder";s:1:"0";}}i:1;a:17:{s:10:"product_id";s:2:"27";s:12:"product_type";s:6:"tshirt";s:9:"design_id";s:1:"2";s:12:"product_game";s:9:"One Piece";s:12:"product_name";s:19:"Luffy''s Gatling gun";s:11:"product_url";s:48:"luffys gatling gun one piece anime t shirt india";s:13:"product_intro";s:147:""gommu gommu no gatling" - Monkey D. Luffy. Grab this one piece t shirt with one of the most inconic attack from everyone''s favorite straw hat man.";s:12:"product_desc";s:1114:"Honestly, there have been countless instances where I wished I had this gatling gun power of luffy at my disposal, times when you just cannot control your rage and feel like punching endlessly.  So when introducing the one piece tee for the first time I knew that it had to somehow give me this ability. <br>\r\nFollowing are just some of the situations where this t shirt can be useful for you :\r\n<br><br>\r\n1. Losing a fifa match or ball hitting the goal post again and again.<br>\r\n2. Your team mates playing shit in counter strike / dota. <br>\r\n3. Your  boss/client talking non sense and not making any sense. <br>\r\n4. Not able to find that one annoying bug no matter how much you debug. <br>\r\n5. Video keeps buffering while watching your favorite thing.<br>\r\n5. Getting killed because of lag. <br><br>\r\nDesign By <a href="https://www.facebook.com/cerinius/" target="_blank"> Anwesha Pradhan.</a><br><br>\r\nLet us know in the comments below about more situations where you might prefer to use this attack. <br><br>\r\nThis one piece anime t shirt is screen printed on a 100% cotton black colored psycho store t shirt.";s:18:"product_image_path";s:35:"images/product/27/gatling_gun_1.png";s:13:"product_price";s:3:"599";s:16:"product_qty_sold";s:1:"0";s:12:"product_date";s:19:"2017-03-19 00:32:59";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";s:14:"product_source";s:7:"inhouse";s:15:"product_details";a:7:{s:9:"tshirt_id";s:2:"29";s:10:"product_id";s:2:"27";s:9:"small_qty";s:1:"5";s:10:"medium_qty";s:1:"5";s:9:"large_qty";s:1:"5";s:6:"xl_qty";s:1:"5";s:13:"size_preorder";s:1:"0";}}i:2;a:17:{s:10:"product_id";s:1:"3";s:12:"product_type";s:4:"mugs";s:9:"design_id";s:1:"9";s:12:"product_game";s:7:"Pokemon";s:12:"product_name";s:16:"Get Sherlocked !";s:11:"product_url";s:40:"half life 2 gaming tshirt sherlock india";s:13:"product_intro";s:25:"Buy this awesome product.";s:12:"product_desc";s:280:"Remember that invincible feeling that you felt on getting S power. The feeling that there''s no stopping you, that you can now destroy any damn enemy in this world. Wear this s power tshirt in real life and be invincible.<br><br><br>Screen Printed on a black 180 gsm cotton tshirt.";s:18:"product_image_path";s:23:"images/product/3/dp.png";s:13:"product_price";s:3:"600";s:16:"product_qty_sold";s:2:"19";s:12:"product_date";s:19:"2014-12-09 01:13:46";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";s:14:"product_source";s:12:"dropshipping";s:15:"product_details";N;}i:3;a:17:{s:10:"product_id";s:2:"28";s:12:"product_type";s:6:"tshirt";s:9:"design_id";s:1:"1";s:12:"product_game";s:9:"Half-Life";s:12:"product_name";s:28:"Black Mesa Research Facility";s:11:"product_url";s:59:"black mesa research facility half life gaming t shirt india";s:13:"product_intro";s:192:""Good morning and welcome to the black mesa transit system. Please wear this t-shirt at all times while handling any hazardous materials for your own safety." - Black mesa announcement system.";s:12:"product_desc";s:1091:"After the infamous <a href="http://combineoverwiki.net/wiki/Black_Mesa_Incident">black mesa incident</a>, we were approached by the black mesa management to create a special tee which would protect the scientists in case a similar incident was to happen again (and we were thinking "yeah right as if you really care about the scientists, we know what you did back then").<br>\r\nBut anyway business is business, so we accepted the offer, they obviously gave us some special chemical and xen substances to integrate in the t-shirt using which we made this half-life t-shirt which is in front of you.<br><br>\r\nWe were able to struck a deal with them where in we got the liberty to provide it to all our fans as well, just in case the next incident was to happen on a much larger scale (see how much we care about you guys).<br>\r\nDo wear this black mesa t-shirt at all times while handling any kind of hazardous materials.<br><br>\r\nLet us know your views in the comments below.<br><br>\r\nThis Half-life inspired gaming t shirt is screen printed on a 100% cotton white colored psycho store t shirt.";s:18:"product_image_path";s:32:"images/product/28/black_mesa.png";s:13:"product_price";s:3:"499";s:16:"product_qty_sold";s:1:"0";s:12:"product_date";s:19:"2017-03-19 19:03:58";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";s:14:"product_source";s:7:"inhouse";s:15:"product_details";a:7:{s:9:"tshirt_id";s:2:"30";s:10:"product_id";s:2:"28";s:9:"small_qty";s:1:"5";s:10:"medium_qty";s:1:"5";s:9:"large_qty";s:1:"5";s:6:"xl_qty";s:1:"5";s:13:"size_preorder";s:1:"0";}}i:4;a:18:{s:10:"product_id";s:2:"12";s:12:"product_type";s:6:"tshirt";s:9:"design_id";s:2:"13";s:12:"product_game";s:13:"Dragon ball z";s:12:"product_name";s:11:"Goku symbol";s:11:"product_url";s:37:"dragon ball z anime goku tshirt india";s:13:"product_intro";s:27:"kaa-mee-haa-mee-haaaaaaa !!";s:12:"product_desc";s:1275:"We were actually going to make a Goku dogi first, but we thought a tshirt would be much better for your wardrobe.<br> So wear this with pride and show off the fact that you are a distinguished warrior who underwent training from both master Roshi and King Kai, mastering in techniques like kamehameha, spirit bomb and kaio-ken.<br>\r\nBut never ever forget, what these symbols actually stand for, remember what goku taught us in the childhood, to never give up in the face of adversties, to always believe in yourself, to always have faith in yourself and always fight for whats right and stand against injustice.\r\nMost importantly never forget that you can achieve any level and overcome any obstacle, given that you are ready to put in the required effort to achieve it.<br>\r\nI dont think we need to tell you what your power level will be after wearing this tshirt, so wear this and we assure you that you will be able to face any damn thing in your life.\r\n<br><br>\r\nNote : Please dont come complaining back to us if you cant shoot energy beams thro