('df6c9a4eb79195592027c32a760210dc', '::1', 'Mozilla/5.0 (Linux; Android 6.0; Nexus 5 Build/MRA58N) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/46.0.2490.76 Mobile', 1473766182, 'a:2:{s:9:"user_data";s:0:"";s:6:"events";N;}'),
('dfb953480e35679e4775f17949e2646a', '::1', 'Mozilla/5.0 (compatible; MSIE 10.0; Windows Phone 8.0; Trident/6.0; IEMobile/10.0; ARM; Touch; NOKIA; Lumia 520)', 1458031653, 'a:6:{s:9:"user_data";s:0:"";s:7:"user_id";s:2:"66";s:8:"username";s:25:"ishkaran.fearme@gmail.com";s:6:"status";s:1:"1";s:6:"events";N;s:15:"recently_viewed";a:1:{i:0;a:18:{s:10:"product_id";s:2:"16";s:12:"product_type";s:6:"Tshirt";s:12:"product_game";s:13:"The Witcher 3";s:12:"product_name";s:20:"Witcher 3 White Wolf";s:11:"product_url";s:41:"witcher 3 white wolf gaming t shirt india";s:13:"product_intro";s:113:"Get your hands on this witcher inspired tee, before you go wandering into the jungle in search of those monsters.";s:12:"product_desc";s:816:"We were really thrilled to hear that our team finally got the chance to interview the legendary monster hunter Geralt Of Rivia aka White Wolf. We really wanted to know the secret behind his speed and reflexes and to our surprise he actually gave us some magical substances to get the taste of his powers firsthand. Our scientists were hard at work for past 6 months to figure out a way to infuse those substances in the t shirts itself so that all our fans can taste Geralt''s powers. <br><br>\r\nSo here you go guys, after shit load of hardwork we present to you this magical tee infused with white wolf''s power and abilities so that even you can enjoy monster hunting now.\r\n<br><br>\r\nLet us know your monster hunting experiences in the comments below. <br><br>\r\n\r\nScreen printed on a 100% cotton black colored tshirt.";s:18:"product_image_path";s:23:"images/product/16/1.png";s:13:"product_price";s:3:"499";s:19:"product_count_small";s:1:"3";s:20:"product_count_medium";s:1:"5";s:19:"product_count_large";s:1:"5";s:16:"product_count_xl";s:1:"5";s:16:"product_qty_sold";s:1:"2";s:12:"product_date";s:19:"2016-02-25 17:28:21";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";}}}'),
('dfcb4e4142b96d744f2ec942495594ad', '::1', 'Mozilla/5.0 (Linux; Android 5.0; SM-G900P Build/LRX21T) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/61.0.3163.100 Mobi', 1508931054, 'a:6:{s:9:"user_data";s:0:"";s:6:"events";N;s:15:"recently_viewed";a:1:{i:0;a:19:{s:10:"product_id";s:2:"19";s:12:"product_type";s:6:"tshirt";s:9:"design_id";s:1:"9";s:12:"product_game";s:7:"Pokemon";s:12:"product_name";s:12:"Pikachu Face";s:11:"product_url";s:40:"pikachu face pokemon anime t shirt india";s:13:"product_intro";s:119:"Wear this tee and get ready to hear people around you yell "I chose you Pikachu". Also don''t forget to say "Pika Pika".";s:12:"product_desc";s:1373:"When we first got the challenge of creating a tee inspired from the legendary anime pokemon, we knew it wasn''t an easy task. Yes, obviously we can create a yet another pokemon tee, but we wanted you guys to actually feel that particular pokemon''s power run through your blood, when wearing that pokemon''s tee and we knew for that, we will need help from the one and only <a target="_blank" href="http://pokemon.wikia.com/wiki/Ash_Ketchum">Ash Ketchum</a>.<br><br>\r\nIt was tough but finally our satellites were able to track him down, we wasted no time in reaching him and told him of our situation, that we wanted to create a pikachu inspired tee which after wearing, should give people the ability to use <a target="_blank" href="http://pokemon.wikia.com/wiki/Thunderbolt">thunderbolt</a> attack and the special <a target="_blank" href="http://pokemon.wikia.com/wiki/Static">static</a> ability. <br><br>\r\nThough it took some convincing but our marketing team (special bonus for them this year) was able to woo him into letting our scientists take some dna samples from pikachu which they then infused with the t-shirt material from which this epic tee is created.<br><br>\r\nNote : Please don''t believe everything you read on the internet.<br><br>\r\nLet us know which other pokemons would you love to catch. <br><br>\r\n\r\nScreen printed on a 100% cotton yellow colored t shirt.";s:18:"product_image_path";s:27:"images/product/19/pika2.png";s:13:"product_price";s:3:"499";s:16:"product_qty_sold";s:2:"40";s:12:"product_date";s:19:"2016-04-11 19:41:39";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:8:"preorder";s:7:"hashtag";s:12:"psychofamous";s:14:"product_source";s:7:"inhouse";s:8:"featured";s:1:"0";s:8:"category";s:6:"Gaming";s:15:"product_details";a:7:{s:9:"tshirt_id";s:1:"4";s:10:"product_id";s:2:"19";s:9:"small_qty";s:1:"5";s:10:"medium_qty";s:1:"5";s:9:"large_qty";s:1:"5";s:6:"xl_qty";s:1:"5";s:13:"size_preorder";s:1:"0";}}}s:13:"cart_contents";a:4:{s:32:"2ed7eb916dd3ea8bfe272652edd57f97";a:8:{s:5:"rowid";s:32:"2ed7eb916dd3ea8bfe272652edd57f97";s:2:"id";s:2:"19";s:3:"qty";s:1:"1";s:5:"price";s:3:"499";s:4:"name";s:12:"Pikachu Face";s:4:"type";s:6:"tshirt";s:7:"options";a:1:{s:5:"extra";s:5:"Large";}s:8:"subtotal";i:499;}s:11:"total_items";i:1;s:10:"cart_total";i:499;s:11:"final_price";d:499;}s:8:"discount";a:2:{s:10:"percentage";i:0;s:6:"coupon";N;}s:6:"txn_id";s:8:"59f0765e";}'),
('e113b07dd4b7e109ed82dc00a7d26a4d', '::1', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/53.0.2785.101 Safari/537.36', 1473781862, 'a:3:{s:9:"user_data";s:0:"";s:6:"events";N;s:15:"recently_viewed";a:1:{i:0;a:19:{s:10:"product_id";s:2:"22";s:12:"product_type";s:6:"Tshirt";s:12:"product_game";s:14:"Counter Strike";s:12:"product_name";s:21:"Invisble Wings Jersey";s:11:"product_url";s:59:"counter strike invisble wings official jersey t shirt india";s:13:"product_intro";s:77:"Show your support for team invisible wings, by wearing their official jersey.";s:12:"product_desc";s:772:"Team Invisible Wings literally came out of nowhere and has shook the Indian e-sports community with their continuous stellar performances and wins. <br>\r\nBacked by the awesome guys at <a href="http://tranzeneca.com/" target="_blank">Tranzeneca Gaming</a>, we are sure they will set the esports world on fire in the coming future.<br><br>\r\nMeanwhile show your support by sporting their killer looking official jersey.\r\n<br><br>\r\nNote : These orders are fulfilled by Invisible Wings themselves and not by Psycho Store, but you can rest assured about the quality.\r\n<br><br>\r\nInivisble Wings official jersey is made by using a delicate balance of cotton and polyster and is not 100% cotton like other psycho store tees.\r\n<br><br>\r\nLet us know your views in the comments below.";s:18:"product_image_path";s:23:"images/product/22/a.png";s:13:"product_price";s:3:"799";s:19:"product_count_small";s:1:"5";s:20:"product_count_medium";s:1:"5";s:19:"product_count_large";s:1:"5";s:16:"product_count_xl";s:1:"5";s:16:"product_qty_sold";s:1:"0";s:12:"product_date";s:19:"2016-08-28 23:52:25";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";s:13:"size_preorder";s:1:"0";}}}');
