('e690841be481ff7ba9dfca0712aec4de', '::1', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/51.0.2704.84 Safari/537.36', 1465822905, 'a:3:{s:9:"user_data";s:0:"";s:6:"events";N;s:15:"recently_viewed";a:3:{i:0;a:19:{s:10:"product_id";s:2:"17";s:12:"product_type";s:6:"Tshirt";s:12:"product_game";s:11:"Programming";s:12:"product_name";s:12:"Coffee Stats";s:11:"product_url";s:39:"coffee stats programming t shirts india";s:13:"product_intro";s:54:"I convert caffeine into code. what''s your super power?";s:12:"product_desc";s:1112:"Disclaimer : Following story is based on real life incidents<br><br>\r\nSo it had been almost 2 hours and i had absolutely no clue what and where it was going wrong. Basically i wanted to show a pop-up on a successfully applied cheat code, but instead i was getting a blank white colored pop-up. That''s it, no text inside. i tried everything, debugged the shit out of the code, but i just couldn''t figure where was my text going!<br>\r\nSo finally,fully exhausted i went into the kitchen to make myself a cup of coffee while i think about the issue. Few sips down, i came back to my screen, opened my website and BAM! there it was, there was the problem right in front of me.<br><br>all my text was white colored<br><br>\r\nSo there I was trying to display white colored text on a white colored pop-up, i don''t know what made me realize this, but right at that moment i decided that i need to make a tee to show off all the benefits of coffee.\r\nSo here is the future me fulfilling my promise.\r\n<br><br>\r\nLet us know what you convert caffeine into. <br><br>\r\n\r\nScreen printed on a 100% cotton royal blue colored tshirt.";s:18:"product_image_path";s:23:"images/product/17/1.png";s:13:"product_price";s:3:"499";s:19:"product_count_small";s:1:"0";s:20:"product_count_medium";s:1:"5";s:19:"product_count_large";s:1:"5";s:16:"product_count_xl";s:1:"5";s:16:"product_qty_sold";s:1:"2";s:12:"product_date";s:19:"2016-02-25 23:15:10";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";s:13:"size_preorder";s:1:"0";}i:1;a:19:{s:10:"product_id";s:1:"7";s:12:"product_type";s:6:"Tshirt";s:12:"product_game";s:12:"Harry Potter";s:12:"product_name";s:17:"Catch that Snitch";s:11:"product_url";s:39:"harry potter gaming tshirt india snitch";s:13:"product_intro";s:25:"Buy this awesome product.";s:12:"product_desc";s:25:"Buy this awesome product.";s:18:"product_image_path";s:22:"images/harrypotter.png";s:13:"product_price";s:3:"500";s:19:"product_count_small";s:1:"6";s:20:"product_count_medium";s:2:"20";s:19:"product_count_large";s:2:"10";s:16:"product_count_xl";s:1:"7";s:16:"product_qty_sold";s:2:"17";s:12:"product_date";s:19:"2014-12-09 01:13:46";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";s:13:"size_preorder";s:1:"0";}i:2;a:19:{s:10:"product_id";s:2:"20";s:12:"product_type";s:6:"Tshirt";s:12:"product_game";s:14:"Counter Strike";s:12:"product_name";s:20:"Loser, Buy A Defuser";s:11:"product_url";s:55:"loser buy a defuser counter strike gaming t shirt india";s:13:"product_intro";s:134:"Dedicated to all those losers who never buy defusers. Always remember to wear this tee to a tournament as a reminder for you know who.";s:12:"product_desc";s:1880:"Based on real fictional events<br><br>\r\nIt was the dawn of the century where an epic battle that has been going for ages was about to come to an end. The balance of the force was about to be shifted to either of the side and it all rested on the capture of a very important and dusty camp site. Millions layed down their lives in their pursuit to capture that camp site. both sides suffered extreme losses, almost all of their global elites were nearing their ends. Just a handful of extremely elite ones remained along with some campers as well who were able to survive this long thanks to their noob camping skills. But there is indeed a thin line that even a noob camping guy should not cross and that is, trying to defuse a bomb without a defusal kit that too in the presence of global elites. Moreover if this particular bomb went off, it would have been an extremely heavy blow to their side.<br>\r\nThe guy defusing the bomb was reciting the prayer under his breath "In the name of the super saiyan god goku, the holy sons gohan and goten and the eternal dragon shenron'', please make this bomb defuse faster. Right then and there in the heat of the battle, a global elite made the right decision and gave a head shot to that guy, his own guy because he knew very well the consequences of the failure. he got to the bomb and defused it in a jiffy using the defusal kit and vowed to always wear a t shirt that would remind everyone not to act like that loser and to buy a defuser.<br><br>\r\nFast forward 30 years, peace has been restored to the valley and in rememberance of that fateful day, we are giving an opportunity to each and every one of you to wear this tee and remind the whole world around you to always and always buy a defuser.<br><br>\r\nLet us know your bomb defusal moments in the comments below. <br><br>\r\n\r\nScreen printed on a 100% cotton black colored t shirt.";s:18:"product_image_path";s:29:"images/product/20/defuser.png";s:13:"product_price";s:3:"499";s:19:"product_count_small";s:1:"5";s:20:"product_count_medium";s:1:"5";s:19:"product_count_large";s:1:"5";s:16:"product_count_xl";s:1:"5";s:16:"product_qty_sold";s:1:"0";s:12:"product_date";s:19:"2016-05-25 02:04:35";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:8:"preorder";s:7:"hashtag";s:12:"psychofamous";s:13:"size_preorder";s:1:"0";}}}'),
('e913d49a4351790037661b39951a8d76', '::1', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/59.0.3071.115 Safari/537.36', 1501234665, 'a:5:{s:9:"user_data";s:0:"";s:6:"events";N;s:15:"recently_viewed";a:6:{i:0;a:19:{s:10:"product_id";s:2:"28";s:12:"product_type";s:6:"tshirt";s:9:"design_id";s:1:"1";s:12:"product_game";s:9:"Half-Life";s:12:"product_name";s:28:"Black Mesa Research Facility";s:11:"product_url";s:59:"black mesa research facility half life gaming t shirt india";s:13:"product_intro";s:192:""Good morning and welcome to the black mesa transit system. Please wear this t-shirt at all times while handling any hazardous materials for your own safety." - Black mesa announcement system.";s:12:"product_desc";s:1091:"After the infamous <a href="http://combineoverwiki.net/wiki/Black_Mesa_Incident">black mesa incident</a>, we were approached by the black mesa management to create a special tee which would protect the scientists in case a similar incident was to happen again (and we were thinking "yeah right as if you really care about the scientists, we know what you did back then").<br>\r\nBut anyway business is business, so we accepted the offer, they obviously gave us some special chemical and xen substances to integrate in the t-shirt using which we made this half-life t-shirt which is in front of you.<br><br>\r\nWe were able to struck a deal with them where in we got the liberty to provide it to all our fans as well, just in case the next incident was to happen on a much larger scale (see how much we care about you guys).<br>\r\nDo wear this black mesa t-shirt at all times while handling any kind of hazardous materials.<br><br>\r\nLet us know your views in the comments below.<br><br>\r\nThis Half-life inspired gaming t shirt is screen printed on a 100% cotton white colored psycho store t shirt.";s:18:"product_image_path";s:32:"images/product/28/black_mesa.png";s:13:"product_price";s:3:"499";s:16:"product_qty_sold";s:1:"2";s:12:"product_date";s:19:"2017-03-19 19:03:58";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";s:14:"product_source";s:7:"inhouse";s:8:"featured";s:1:"1";s:8:"category";s:6:"Gaming";s:15:"product_details";a:7:{s:9:"tshirt_id";s:2:"30";s:10:"product_id";s:2:"28";s:9:"small_qty";s:1:"5";s:10:"medium_qty";s:1:"4";s:9:"large_qty";s:1:"5";s:6:"xl_qty";s:1:"4";s:13:"size_preorder";s:1:"0";}}i:1;a:19:{s:10:"product_id";s:2:"38";s:12:"product_type";s:6:"tshirt";s:9:"design_id";s:1:"0";s:12:"product_game";s:9:"Overwatch";s:12:"product_name";s:25:"Cheers Love Cavalrys here";s:11:"product_url";s:64:"cheers love cavalrys here tracer overwatch gaming t shirts india";s:13:"product_intro";s:59:"Cheers love! The tracer inspired overwatch t shirt is here.";s:12:"product_desc";s:1140:"After the tragic accident of the teleporting fighter plane, splitstream, everyone had lost hope for lena oxton aka tracer. Luckily she resurfaced few months back but that accident had already taken it''s toll. It was difficult for her just to maintain her physical form in the present, she practically became a living ghost. We have winston to thanks for bringing stability to tracer and giving her the powers to zip through time.<br>\r\nBut little did we know that winston is still working on ways to even enhance tracer''s abilities and empower her even more.<br><br>\r\nWe have reasonable reasons to believe that this design will be used to further enhance her powers and being the good guys we are, we decided to launch this design on our tees for all our fans and tracer''s fans to wear and enhance their powers as well.<br><br>\r\nDesign By <a href="https://www.facebook.com/cerinius/" target="_blank"> Anwesha Pradhan.</a><br><br>\r\nLet us know your favorite overwatch character in the comments below<br><br>\r\nThis overwatch tracer gaming t shirt is printed using direct to garment printing on a 100% co