('eb3f4066b047fa28c17ebad2c2095263', '::1', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/57.0.2987.133 Safari/537.36', 1492069812, 'a:3:{s:9:"user_data";s:0:"";s:6:"events";N;s:15:"recently_viewed";a:4:{i:0;a:17:{s:10:"product_id";s:2:"29";s:12:"product_type";s:6:"tshirt";s:9:"design_id";s:1:"0";s:12:"product_game";s:9:"Overwatch";s:12:"product_name";s:11:"Die Die Die";s:11:"product_url";s:43:"reaper walks overwatch gaming t shirt india";s:13:"product_intro";s:185:"Watch everyone around you run for cover as you walk around like death, wearing this overwatch reaper t shirt. Just don''t start yelling die, die, die yourself, let reaper do the talking.";s:12:"product_desc";s:1913:"I still remember it like it happened just few minutes back. I was totally engrossed in programming when I heard that loud thud in my living room, it was 3 am in the night. It was pretty strange but still I went to see what was happening and to my astonishment I saw reaper standing there, like actually standing right in front of me. I was literally dumbfound and didn''t know how to react as I had played reaper before but he was not my first choice. But never imagined that it would bring him to me in reality. <br><br>\r\nReaper : "I heard you are launching a new overwatch inspired t shirt?"<br>\r\nMe : "Wow! we didn''t knew we were so famous among overwatch heroes."<br>\r\nReaper : "Can I know which hero are you chosing first?"<br>\r\nMe : "Well honestly I am thinking of going with tracer since shes everyone''s heartthrob."<br>\r\nReaper : "I kneeeeeew it! You wouldn''t chose me. Anyway  I have a confession to make. I might come of as a really dark and strong character which I am btw, without a doubt. But still honestly I am also pretty soft at heart and I want you guys to help me change people''s perception of me by launching a cute but yet a strong design of mine."<br>\r\nMe : "Well, this actually sounds like a nice idea, I guess tracer can wait a bit. We can do this for you."<br>\r\nReaper : "Good, I will be looking forward to it and btw don''t forget to add my favorite line"<br>\r\nMe : "Die! Die! Die!"<br><br>\r\nSo here we are, finally fulfilling our promise to reaper who btw made us change the design n no. of times (hence the delay in launch). Believe us guys he is actually pretty soft at heart once he stops yelling.<br><br>\r\nDesign By <a href="https://www.facebook.com/cerinius/" target="_blank"> Anwesha Pradhan.</a><br><br>\r\nLet us know which hero you want us to design next.<br><br>\r\nThis overwatch inspired gaming t shirt is digitally printed on a 100% cotton turquoise colored psycho store t shirt.";s:18:"product_image_path";s:38:"images/product/29/overwatch_reaper.png";s:13:"product_price";s:3:"599";s:16:"product_qty_sold";s:1:"0";s:12:"product_date";s:19:"2017-04-03 01:44:47";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";s:14:"product_source";s:7:"inhouse";s:15:"product_details";a:7:{s:9:"tshirt_id";s:2:"31";s:10:"product_id";s:2:"29";s:9:"small_qty";s:1:"5";s:10:"medium_qty";s:1:"5";s:9:"large_qty";s:1:"5";s:6:"xl_qty";s:1:"5";s:13:"size_preorder";s:1:"0";}}i:1;a:17:{s:10:"product_id";s:1:"7";s:12:"product_type";s:6:"tshirt";s:9:"design_id";s:2:"12";s:12:"product_game";s:11:"programming";s:12:"product_name";s:13:"Forever Alone";s:11:"product_url";s:44:"dates updates meme programming t shirt india";s:13:"product_intro";s:132:"At least my apps never forget me and are brave enough to date me. So wear this classic meme t shirt to show your love for your apps.";s:12:"product_desc";s:974:"It was late in the night and I was watching dragon ball super, since the episode was filler I could afford to divert some of my neurotic bandwidth towards my phone. I was kind of waiting for it to buzz for some time now, like no matter what you are doing, somehow in the back of your mind that process is running in asynchronous mode continuously polling your phoneto see if you have a notification or not. <br><br>\r\nSo much for all the books read on being in the now going to drain, how does people even manage to put that knowledge into practice is beyond me.\r\n<br>\r\nSo coming back to the topic, i unlocked my phone and there it was, a notification, but not the one I was waiting for.<br>\r\nMe : "Damn, just another update".<br>\r\nOpens the app and it was then when reality hit me. Unmatched.<br><br>\r\nLet us know your forever alone moments in the comments below .<br><br>\r\nThis meme programming t shirt is screen printed on a 100% cotton black colored psycho store t shirt.";s:18:"product_image_path";s:26:"images/product/7/dates.png";s:13:"product_price";s:3:"500";s:16:"product_qty_sold";s:2:"17";s:12:"product_date";s:19:"2014-12-09 01:13:46";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";s:14:"product_source";s:7:"inhouse";s:15:"product_details";a:7:{s:9:"tshirt_id";s:2:"16";s:10:"product_id";s:1:"7";s:9:"small_qty";s:1:"5";s:10:"medium_qty";s:1:"5";s:9:"large_qty";s:1:"5";s:6:"xl_qty";s:1:"5";s:13:"size_preorder";s:1:"0";}}i:2;a:17:{s:10:"product_id";s:2:"28";s:12:"product_type";s:6:"tshirt";s:9:"design_id";s:1:"1";s:12:"product_game";s:9:"Half-Life";s:12:"product_name";s:28:"Black Mesa Research Facility";s:11:"product_url";s:59:"black mesa research facility half life gaming t shirt india";s:13:"product_intro";s:192:""Good morning and welcome to the black mesa transit system. Please wear this t-shirt at all times while handling any hazardous materials for your own safety." - Black mesa announcement system.";s:12:"product_desc";s:1091:"After the infamous <a href="http://combineoverwiki.net/wiki/Black_Mesa_Incident">black mesa incident</a>, we were approached by the black mesa management to create a special tee which would protect the scientists in case a similar incident was to happen again (and we were thinking "yeah right as if you really care about the scientists, we know what you did back then").<br>\r\nBut anyway business is business, so we accepted the offer, they obviously gave us some special chemical and xen substances to integrate in the t-shirt using which we made this half-life t-shirt which is in front of you.<br><br>\r\nWe were able to struck a deal with them where in we got the liberty to provide it to all our fans as well, just in case the next incident was to happen on a much larger scale (see how much we care about you guys).<br>\r\nDo wear this black mesa t-shirt at all times while handling any kind of hazardous materials.<br><br>\r\nLet us know your views in the comments below.<br><br>\r\nThis Half-life inspired gaming t shirt is screen printed on a 100% cotton white colored psycho store t shirt.";s:18:"product_image_path";s:32:"images/product/28/black_mesa.png";s:13:"product_price";s:3:"499";s:16:"product_qty_sold";s:1:"0";s:12:"product_date";s:19:"2017-03-19 19:03:58";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";s:14:"product_source";s:7:"inhouse";s:15:"product_details";a:7:{s:9:"tshirt_id";s:2:"30";s:10:"product_id";s:2:"28";s:9:"small_qty";s:1:"5";s:10:"medium_qty";s:1:"5";s:9:"large_qty";s:1:"5";s:6:"xl_qty";s:1:"5";s:13:"size_preorder";s:1:"0";}}i:3;a:17:{s:10:"product_id";s:2:"27";s:12:"product_type";s:6:"tshirt";s:9:"design_id";s:1:"2";s:12:"product_game";s:9:"One Piece";s:12:"product_name";s:19:"Luffy''s Gatling gun";s:11:"product_url";s:48:"luffys gatling gun one piece anime t shirt india";s:13:"product_intro";s:147:""gommu gommu no gatling" - Monkey D. Luffy. Grab this one piece t shirt with one of the most inconic attack from everyone''s favorite straw hat man.";s:12:"product_desc";s:1114:"Honestly, there have been countless instances where I wished I had this gatling gun power of luffy at my disposal, times when you just cannot control your rage and feel like punching endlessly.  So when introducing the one piece tee for the first time I knew that it had to somehow give me this ability. <br>\r\nFollowing are just some of the situations where this t shirt can be useful for you :\r\n<br><br>\r\n1. Losing a fifa match or ball hitting the goal post again and again.<br>\r\n2. Your team mates playing shit in counter strike / dota. <br>\r\n3. Your  boss/client talking non sense and not making any sense. <br>\r\n4. Not able to find that one annoying bug no matter how much you debug. <br>\r\n5. Video keeps buffering while watching your favorite thing.<br>\r\n5. Getting killed because of lag. <br><br>\r\nDesign By <a href="https://www.facebook.com/cerinius/" target="_blank"> Anwesha Pradhan.</a><br><br>\r\nLet us know in the comments below about more situations where you might prefer to use this attack. <br><br>\r\nThis one piece anime t shirt is screen printed on a 100% cotton black colored psycho store t shirt.";s:18:"product_image_path";s:35:"images/product/27/gatling_gun_1.png";s:13:"product_price";s:3:"599";s:16:"product_qty_sold";s:1:"0";s:12:"product_date";s:19:"2017-03-19 00:32:59";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";s:14:"product_source";s:7:"inhouse";s:15:"product_details";a:7:{s:9:"tshirt_id";s:2:"29";s:10:"product_id";s:2:"27";s:9:"small_qty";s:1:"5";s:10:"medium_qty";s:1:"5";s:9:"large_qty";s:1:"5";s:6:"xl_qty";s:1:"5";s:13:"size_preorder";s:1:"0";}}}}'),
('ed606f0b1226456e2d620409ec2c8559', '::1', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/53.0.2785.116 Safari/537.36', 1474971164, 'a:3:{s:9:"user_data";s:0:"";s:6:"events";N;s:15:"recently_viewed";a:1:{i:0;a:15:{s:10:"product_id";s:2:"21";s:12:"product_type";s:6:"tshirt";s:12:"product_game";s:7:"Pokemon";s:12:"product_name";s:16:"Being Charmander";s:11:"product_url";s:43:"being charmander pokemon anime sthirt india";s:13:"product_intro";s:141:"We shall not be held responsible if after wearing this pokemon t shirt you somehow evolve from charmander to chairzard and become a lazy bum.";s:12:"product_desc";s:847:"So it had been quite some time since we caught our first pokemon (pikachu) and we decided it was time to again go pokemon hunting. Turns out the luck was on our side and we managed to capture this beauty, yes charmander it is. After capturing this cute little fiery beast our scientists tried to mimic it''s tail, where in the flame on it''s tail indicates chamander''s emotions. We thought we might be able to do something similar, but alas our scientists were not capable enough.\r\n<br><br>\r\nSo we thought chuck it, we will just capture the happy emotions from charmander and infuse it into the t shirt and that is exactly what we did. So we assure you that after wearing this pokemon t shirt, happiness is the only emotion you will feel.\r\n<br><br>\r\nThis charmander pokemon tee is screen printed on a 100% cotton orange colored psycho store t shirt.";s:18:"product_image_path";s:32:"images/product/21/charmander.png";s:13:"product_price";s:3:"499";s:16:"product_qty_sold";s:1:"1";s:12:"product_date";s:19:"2016-08-23 03:43:04";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";s:15:"product_details";a:0:{}}}}'),
('ee2ad70a3de151a96cacfef0b26ec90b', '::1', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/53.0.2785.101 Safari/537.36', 1473773468, 'a:9:{s:9:"user_data";s:0:"";s:6:"events";N;s:7:"user_id";s:2:"93";s:8:"username";s:25:"ishkaran.fearme@gmail.com";s:6:"status";s:1:"1";s:15:"recently_viewed";a:1:{i:0;a:19:{s:10:"product_id";s:2:"23";s:12:"product_type";s:6:"Tshirt";s:12:"product_game";s:6:"naruto";s:12:"product_name";s:24:"Kamui Mangekyo Sharnigan";s:11:"product_url";s:51:"kamui mangekyo sharnigan naruto anime t shirt india";s:13:"product_intro";s:148:"Wear this naruto inspired t shirt to awaken the mangekyo sharingan inside you and gain the special ability of kamui just like obito and kakashi had.";s:12:"product_desc";s:969:"Ever since we came to know about the special and eternal power of mangekyo sharingan, we wanted one for ourself, but the icing on the cake was when we came to know about ''Kamui''. The special sharingan ability which can transfer people or best of all yourself to another dimension.<br><br>\r\nJust imagine being stuck with your boss or even gf/bf blabbering about this and that and poof! you are gone. Solves just so many of our problems, right?<br>\r\nWell, we are so excited to inform you that now you can actually own this power by wearing our kamui t shirt. We went to great lengths and put in a lot of effort to make sure this power comes to each and every one of us who has the will to awaken his/her mangekyo sharingan.<br><br>\r\nLet us know in the comments below which other powers/abilities you would like to gain and we will make sure to put them on our tees.<br><br>\r\nThis naruto anime t shirt is screen printed on a 100% cotton black colored psycho store t shirt.";s:18:"product_image_path";s:37:"images/product/23/kamui_sharingan.png";s:13:"product_price";s:3:"499";s:19:"product_count_small";s:1:"5";s:20:"product_count_medium";s:1:"5";s:19:"product_count_large";s:1:"5";s:16:"product_count_xl";s:1:"5";s:16:"product_qty_sold";s:1:"0";s:12:"product_date";s:19:"2016-09-10 02:48:49";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";s:13:"size_preorder";s:1:"0";}}s:13:"cart_contents";a:4:{s:32:"71c67b8cfe6b2a7cecfcdd71fbac5ab0";a:7:{s:5:"rowid";s:32:"71c67b8cfe6b2a7cecfcdd71fbac5ab0";s:2:"id";s:2:"23";s:3:"qty";s:1:"1";s:5:"price";s:3:"499";s:4:"name";s:24:"Kamui Mangekyo Sharnigan";s:7:"options";a:1:{s:4:"Size";s:6:"Medium";}s:8:"subtotal";i:499;}s:11:"total_items";i:1;s:10:"cart_total";i:499;s:11:"final_price";d:499;}s:8:"discount";a:2:{s:10:"percentage";i:0;s:6:"coupon";s:5:"nkdlv";}s:6:"txn_id";s:8:"57d70b37";}');
