duct_price";s:3:"499";s:19:"product_count_small";s:1:"4";s:20:"product_count_medium";s:1:"5";s:19:"product_count_large";s:1:"5";s:16:"product_count_xl";s:1:"5";s:16:"product_qty_sold";s:1:"1";s:12:"product_date";s:19:"2016-02-25 23:15:10";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";}}}'),
('f10a546d43f5f09fb905e3be96aab19a', '::1', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/53.0.2785.101 Safari/537.36', 1473796560, 'a:3:{s:9:"user_data";s:0:"";s:6:"events";N;s:15:"recently_viewed";a:2:{i:0;a:19:{s:10:"product_id";s:2:"23";s:12:"product_type";s:6:"Tshirt";s:12:"product_game";s:6:"naruto";s:12:"product_name";s:24:"Kamui Mangekyo Sharnigan";s:11:"product_url";s:51:"kamui mangekyo sharnigan naruto anime t shirt india";s:13:"product_intro";s:148:"Wear this naruto inspired t shirt to awaken the mangekyo sharingan inside you and gain the special ability of kamui just like obito and kakashi had.";s:12:"product_desc";s:969:"Ever since we came to know about the special and eternal power of mangekyo sharingan, we wanted one for ourself, but the icing on the cake was when we came to know about ''Kamui''. The special sharingan ability which can transfer people or best of all yourself to another dimension.<br><br>\r\nJust imagine being stuck with your boss or even gf/bf blabbering about this and that and poof! you are gone. Solves just so many of our problems, right?<br>\r\nWell, we are so excited to inform you that now you can actually own this power by wearing our kamui t shirt. We went to great lengths and put in a lot of effort to make sure this power comes to each and every one of us who has the will to awaken his/her mangekyo sharingan.<br><br>\r\nLet us know in the comments below which other powers/abilities you would like to gain and we will make sure to put them on our tees.<br><br>\r\nThis naruto anime t shirt is screen printed on a 100% cotton black colored psycho store t shirt.";s:18:"product_image_path";s:37:"images/product/23/kamui_sharingan.png";s:13:"product_price";s:3:"499";s:19:"product_count_small";s:1:"5";s:20:"product_count_medium";s:1:"5";s:19:"product_count_large";s:1:"5";s:16:"product_count_xl";s:1:"5";s:16:"product_qty_sold";s:1:"0";s:12:"product_date";s:19:"2016-09-10 02:48:49";s:19:"add_to_cart_comment";s:56:"Psycho Store : Wear this on a first date, you will rock.";s:13:"product_state";s:4:"live";s:7:"hashtag";s:12:"psychofamous";s:13:"size_preorder";s:1:"0";}i:1;a:19:{s:10:"product_id";s:2:"12";s:12:"product_type";s:6:"Tshirt";s:12:"product_game";s:13:"Dragon ball z";s:12:"product_name";s:11:"Goku symbol";s:11:"product_url";s:37:"dragon ball z anime goku tshirt india";s:13:"product_intro";s:27:"kaa-mee-haa-mee-haaaaaaa !!";s:12:"product_desc";s:1275:"We were actually going to make a Goku dogi first, but we thought a tshirt would be much better for your wardrobe.<br> So wear this with pride and show off the fact that you are a distinguished warrior who underwent training from both master Roshi and King Kai, mastering in techniques like kamehameha, spirit bomb and kaio-ken.<br>\r\nBut never ever forget, what these symbols actually stand for, remember what goku taught us in the childhood, to never give up in the face of adversties, to always believe in yourself, to always have faith in yourself and always fight for whats right and stand against injustice.\r\nMost importantly never forget that you can achieve any level and overcome any obstacle, given that you are ready to put in the required effort to achieve it.<br>\r\nI dont think we need to tell you what your power level will be after wearing this tshirt, so wear this and we assure you that you will be able to face any damn thing in your life.\r\n<br><br>\r\nNote : Please dont come complaining back to us if you cant shoot energy beams through your hands, or if nothing happens when you shout kamehameha, be realistic guys, its just a t shirt after all.\r\n<br><br>\r\nLet us know your views in the comments below.\r\n<br><br>Screen printed on a 100% cotton orange tshirt.";s:18:"product_image_path";s:15:"images/goku.png";s:13:"product_price";s:3:"600";s:19:"product_count_small";s:1:"0";s:20:"product_count_medium";s:1:"8";s:19:"product_count_large";s:2:"10";s:16:"product_count_xl";s:2:"10";s:16:"product_qty_sold"