(6, 'mobilecover', 24, 'Half Life 2', 'Bahadur Bille', 'half life 2 bahadur bille gaming tshirt india', 'Best FPS ever created.', 'Be prepared the monster of the mosters, DOOM is coming near and so is the end along with it. Pay your tribute to one of the scariest and best fps ever created and yeah to John Carmack as well.', 'images/product/6/default.png', 600, 12, '2014-12-08 19:43:46', 'Psycho Store : Doom is coming near, this t-shirt will keep you prepared.', 'preorder', 'psychofamous', 'inhouse', 0, 'Gaming'),
(7, 'tshirt', 12, 'programming', 'Forever Alone', 'dates updates meme programming t shirt india', 'At least my apps never forget me and are brave enough to date me. So wear this classic meme t shirt to show your love for your apps.', 'It was late in the night and I was watching dragon ball super, since the episode was filler I could afford to divert some of my neurotic bandwidth towards my phone. I was kind of waiting for it to buzz for some time now, like no matter what you are doing, somehow in the back of your mind that process is running in asynchronous mode continuously polling your phoneto see if you have a notification or not. <br><br>\r\nSo much for all the books read on being in the now going to drain, how does people even manage to put that knowledge into practice is beyond me.\r\n<br>\r\nSo coming back to the topic, i unlocked my phone and there it was, a notification, but not the one I was waiting for.<br>\r\nMe : "Damn, just another update".<br>\r\nOpens the app and it was then when reality hit me. Unmatched.<br><br>\r\nLet us know your forever alone moments in the comments below .<br><br>\r\nThis meme programming t shirt is screen printed on a 100% cotton black colored psycho store t shirt.', 'images/product/7/dates.png', 500, 17, '2014-12-08 19:43:46', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychofamous', 'inhouse', 0, 'Gaming'),
