(12, 'tshirt', 13, 'Dragon ball z', 'Goku symbol', 'dragon ball z anime goku tshirt india', 'kaa-mee-haa-mee-haaaaaaa !!', 'We were actually going to make a Goku dogi first, but we thought a tshirt would be much better for your wardrobe.<br> So wear this with pride and show off the fact that you are a distinguished warrior who underwent training from both master Roshi and King Kai, mastering in techniques like kamehameha, spirit bomb and kaio-ken.<br>\r\nBut never ever forget, what these symbols actually stand for, remember what goku taught us in the childhood, to never give up in the face of adversties, to always believe in yourself, to always have faith in yourself and always fight for whats right and stand against injustice.\r\nMost importantly never forget that you can achieve any level and overcome any obstacle, given that you are ready to put in the required effort to achieve it.<br>\r\nI dont think we need to tell you what your power level will be after wearing this tshirt, so wear this and we assure you that you will be able to face any damn thing in your life.\r\n<br><br>\r\nNote : Please dont come complaining back to us if you cant shoot energy beams through your hands, or if nothing happens when you shout kamehameha, be realistic guys, its just a t shirt after all.\r\n<br><br>\r\nLet us know your views in the comments below.\r\n<br><br>Screen printed on a 100% cotton orange tshirt.', 'images/goku.png', 600, 34, '2014-12-08 19:43:46', 'Wear this on a first date, you will rock.', 'live', 'psychofamous', 'inhouse', 1, 'Gaming'),
(13, 'tshirt', 13, 'Fallout', 'Fallout : Nuka Cola', 'nuka cola fallout gaming tshirt india', 'The most popular drink of the wasteland, now printed on a t shirt for you to wear and show your support for the post apocalyptic world.', 'We have utmost respect for <a target="_blank" href="http://fallout.wikia.com/wiki/John-Caleb_Bradberton">John-Caleb Bradberton</a> for inventing the most popular soft drink ever. Even after the great war, nuka cola remains the #1 drink of the post apocalyptic world. Even their bottle caps can be seen being used as a currency in the new world. <br>\r\nSince everyone knows the fact that "War, War never changes", we bring to you the ice cold version of this drink for you to chill and deal with the fact.\r\n<br><br>Wear this t shirt and pay your tribute to one of the best rpg game ever made, that has been training you for years in case an apocalyptic situation arises.\r\n<br><br>\r\nLet us know your best nuka cola moments in the comments below. <br><br>\r\nScreen printed on a 100% cotton red tshirt.', 'images/product/13/1.png', 600, 20, '2014-12-08 19:43:46', 'Wear this on a first date, you will rock.', 'preorder', 'psychofamous', 'inhouse', 0, 'Gaming'),
(14, 'tshirt', 14, 'One Punch man', 'OK.', 'one punch man ok anime t shirt india', 'We can''t give you saitama''s powers, but his attitude is the closest thing that you can get by wearing this tee.', 'We tried a lot to make a t shirt that would grant you saitama''s powers, but unfortunately our scientists couldn''t crack the code for that, but it''s not like that we have given up on it, believe us our scientists are still working on it. Meantime we came up with this innovative t shirt to give you a taste of saitama''s attitude towards life and especially problems. So however grave and dismal the situation be all you need to do is wear this t shirt and say ok and believe us its gonna be all right.<br><br>\r\nLet us know your views of your ok moments in the comments below. <br><br>\r\n\r\nScreen printed on a 100% cotton golden yellow colored tshirt.', 'images/product/14/1.png', 599, 13, '2015-01-31 21:02:14', 'Wear this on a first date, you will rock.', 'live', 'psychospower', 'inhouse', 0, 'Gaming'),
(15, 'tshirt', 16, 'Mario', 'One Up T Shirt', 'mario one up gaming t shirt india', 'On the purchase of this t shirt you get an additional you!', 'After years of extensive research, our scientists at psycho labs have finally cracked the formula that gave mario an extra life, equipped with this vital information our scientists have created this 1-up t shirt that will give you an extra life. So whatever the situation is, you can definitely count on this tee to give you 1-up. believe us this is psycho labs certified. <br><br>\r\n\r\nNote(our lawyers forced us to add this) : This description is supposed to be taken as a joke, don''t start banging your head against walls or start jumping down the clifs.\r\n<br><br>\r\nLet us know your views in the comments below. <br><br>\r\n\r\nScreen printed on a 100% cotton green colored tshirt.', 'images/product/15/1.png', 350, 1, '2015-11-04 08:50:42', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychofamous', 'inhouse', 0, 'Gaming'),
(16, 'tshirt', 17, 'The Witcher 3', 'Witcher 3 White Wolf', 'witcher 3 white wolf gaming t shirt india', 'Get your hands on this witcher inspired tee, before you go wandering into the jungle in search of those monsters.', 'We were really thrilled to hear that our team finally got the chance to interview the legendary monster hunter Geralt Of Rivia aka White Wolf. We really wanted to know the secret behind his speed and reflexes and to our surprise he actually gave us some magical substances to get the taste of his powers firsthand. Our scientists were hard at work for past 6 months to figure out a way to infuse those substances in the t shirts itself so that all our fans can taste Geralt''s powers. <br><br>\r\nSo here you go guys, after shit load of hardwork we present to you this magical tee infused with white wolf''s power and abilities so that even you can enjoy monster hunting now.\r\n<br><br>\r\nLet us know your monster hunting experiences in the comments below. <br><br>\r\n\r\nScreen printed on a 100% cotton black colored tshirt.', 'images/product/16/1.png', 499, 3, '2016-02-25 11:58:21', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychofamous', 'inhouse', 0, 'Gaming'),
(17, 'tshirt', 19, 'Programming', 'Coffee Stats', 'coffee stats programming t shirts india', 'I convert caffeine into code. what''s your super power?', 'Disclaimer : Following story is based on real life incidents<br><br>\r\nSo it had been almost 2 hours and i had absolutely no clue what and where it was going wrong. Basically i wanted to show a pop-up on a successfully applied cheat code, but instead i was getting a blank white colored pop-up. That''s it, no text inside. i tried everything, debugged the shit out of the code, but i just couldn''t figure where was my text going!<br>\r\nSo finally,fully exhausted i went into the kitchen to make myself a cup of coffee while i think about the issue. Few sips down, i came back to my screen, opened my website and BAM! there it was, there was the problem right in front of me.<br><br>all my text was white colored<br><br>\r\nSo there I was trying to display white colored text on a white colored pop-up, i don''t know what made me realize this, but right at that moment i decided that i need to make a tee to show off all the benefits of coffee.\r\nSo here is the future me fulfilling my promise.\r\n<br><br>\r\nLet us know what you convert caffeine into. <br><br>\r\n\r\nScreen printed on a 100% cotton royal blue colored tshirt.', 'images/product/17/1.png', 499, 2, '2016-02-25 17:45:10', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychofamous', 'inhouse', 0, 'Gaming'),
(18, 'tshirt', 18, 'Metal Gear Solid', 'Diamond Dogs', 'metal gear solid diamond dogs gaming t shirt india', 'True diamond dogs wear this metal gear solid tee. Are you one of them?', 'Do you remember the time which started the era of private military organisations and diamond dogs (1984 - 1995) was at the forefront of it who were willing to take up unsavory jobs for the clients but still at the same time always managed to maintain pride in their work. Not just this they were led by one of the most charismatic leader ever, the venom snake.<br><br>\r\nSo wear this tee with pride and show your support for those "dogs of war" and yes be a diamond dog yourself.<br><br>\r\nLet us know your views in the comments below. <br><br>\r\n\r\nScreen printed on a 100% cotton steel grey colored t shirt.', 'images/product/18/2.png', 499, 0, '2016-04-07 19:42:13', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychofamous', 'inhouse', 0, 'Gaming'),
(19, 'tshirt', 9, 'Pokemon', 'Pikachu Face', 'pikachu face pokemon anime t shirt india', 'Wear this tee and get ready to hear people around you yell "I chose you Pikachu". Also don''t forget to say "Pika Pika".', 'When we first got the challenge of creating a tee inspired from the legendary anime pokemon, we knew it wasn''t an easy task. Yes, obviously we can create a yet another pokemon tee, but we wanted you guys to actually feel that particular pokemon''s power run through your blood, when wearing that pokemon''s tee and we knew for that, we will need help from the one and only <a target="_blank" href="http://pokemon.wikia.com/wiki/Ash_Ketchum">Ash Ketchum</a>.<br><br>\r\nIt was tough but finally our satellites were able to track him down, we wasted no time in reaching him and told him of our situation, that we wanted to create a pikachu inspired tee which after wearing, should give people the ability to use <a target="_blank" href="http://pokemon.wikia.com/wiki/Thunderbolt">thunderbolt</a> attack and the special <a target="_blank" href="http://pokemon.wikia.com/wiki/Static">static</a> ability. <br><br>\r\nThough it took some convincing but our marketing team (special bonus for them this year) was able to woo him into letting our scientists take some dna samples from pikachu which they then infused with the t-shirt material from which this epic tee is created.<br><br>\r\nNote : Please don''t believe everything you read on the internet.<br><br>\r\nLet us know which other pokemons would you love to catch. <br><br>\r\n\r\nScreen printed on a 100% cotton yellow colored t shirt.', 'images/product/19/pika2.png', 499, 40, '2016-04-11 14:11:39', 'Psycho Store : Wear this on a first date, you will rock.', 'preorder', 'psychofamous', 'inhouse', 0, 'Gaming'),
(20, 'tshirt', 20, 'Counter Strike', 'Loser Buy A Defuser', 'loser buy a defuser counter strike gaming t shirt india', 'Dedicated to all those losers who never buy defusers. Always remember to wear this tee to a tournament as a reminder for you know who.', 'Based on real fictional events<br><br>\r\nIt was the dawn of the century where an epic battle that has been going for ages was about to come to an end. The balance of the force was about to be shifted to either of the side and it all rested on the capture of a very important and dusty camp site. Millions layed down their lives in their pursuit to capture that camp site. both sides suffered extreme losses, almost all of their global elites were nearing their ends. Just a handful of extremely elite ones remained along with some campers as well who were able to survive this long thanks to their noob camping skills. But there is indeed a thin line that even a noob camping guy should not cross and that is, trying to defuse a bomb without a defusal kit that too in the presence of global elites. Moreover if this particular bomb went off, it would have been an extremely heavy blow to their side.<br>\r\nThe guy defusing the bomb was reciting the prayer under his breath "In the name of the super saiyan god goku, the holy sons gohan and goten and the eternal dragon shenron'', please make this bomb defuse faster. Right then and there in the heat of the battle, a global elite made the right decision and gave a head shot to that guy, his own guy because he knew very well the consequences of the failure. he got to the bomb and defused it in a jiffy using the defusal kit and vowed to always wear a t shirt that would remind everyone not to act like that loser and to buy a defuser.<br><br>\r\nFast forward 30 years, peace has been restored to the valley and in rememberance of that fateful day, we are giving an opportunity to each and every one of you to wear this tee and remind the whole world around you to always and always buy a defuser.<br><br>\r\nLet us know your bomb defusal moments in the comments below. <br><br>\r\n\r\nScreen printed on a 100% cotton black colored t shirt.', 'images/product/20/defuser.png', 499, 0, '2016-05-24 20:34:35', 'Psycho Store : Wear this on a first date, you will rock.', 'preorder', 'psychofamous', 'inhouse', 0, 'Gaming'),
(21, 'tshirt', 11, 'Pokemon', 'Being Charmander', 'being charmander pokemon anime sthirt india', 'We shall not be held responsible if after wearing this pokemon t shirt you somehow evolve from charmander to chairzard and become a lazy bum.', 'So it had been quite some time since we caught our first pokemon (pikachu) and we decided it was time to again go pokemon hunting. Turns out the luck was on our side and we managed to capture this beauty, yes charmander it is. After capturing this cute little fiery beast our scientists tried to mimic it''s tail, where in the flame on it''s tail indicates chamander''s emotions. We thought we might be able to do something similar, but alas our scientists were not capable enough.\r\n<br><br>\r\nSo we thought chuck it, we will just capture the happy emotions from charmander and infuse it into the t shirt and that is exactly what we did. So we assure you that after wearing this pokemon t shirt, happiness is the only emotion you will feel.\r\n<br><br>\r\nThis charmander pokemon tee is screen printed on a 100% cotton orange colored psycho store t shirt.', 'images/product/21/bulbasaur.png', 499, 4, '2016-08-22 22:13:04', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychofamous', 'inhouse', 0, 'Gaming'),
(22, 'tshirt', 26, 'Counter Strike', 'Invisble Wings Jersey', 'counter strike invisble wings official jersey t shirt india', 'Show your support for team invisible wings, by wearing their official jersey.', 'Team Invisible Wings literally came out of nowhere and has shook the Indian e-sports community with their continuous stellar performances and wins. <br>\r\nBacked by the awesome guys at <a href="http://tranzeneca.com/" target="_blank">Tranzeneca Gaming</a>, we are sure they will set the esports world on fire in the coming future.<br><br>\r\nMeanwhile show your support by sporting their killer looking official jersey.\r\n<br><br>\r\nNote : These orders are fulfilled by Invisible Wings themselves and not by Psycho Store, but you can rest assured about the quality.\r\n<br><br>\r\nInivisble Wings official jersey is made by using a delicate balance of cotton and polyster and is not 100% cotton like other psycho store tees.\r\n<br><br>\r\nLet us know your views in the comments below.', 'images/product/22/a.png', 799, 5, '2016-08-28 18:22:25', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychofamous', 'inhouse', 0, 'Gaming'),
(23, 'tshirt', 8, 'naruto', 'Kamui Mangekyo Sharnigan', 'kamui mangekyo sharnigan naruto anime t shirt india', 'Wear this naruto inspired t shirt to awaken the mangekyo sharingan inside you and gain the special ability of kamui just like obito and kakashi had.', 'Ever since we came to know about the special and eternal power of mangekyo sharingan, we wanted one for ourself, but the icing on the cake was when we came to know about ''Kamui''. The special sharingan ability which can transfer people or best of all yourself to another dimension.<br><br>\r\nJust imagine being stuck with your boss or even gf/bf blabbering about this and that and poof! you are gone. Solves just so many of our problems, right?<br>\r\nWell, we are so excited to inform you that now you can actually own this power by wearing our kamui t shirt. We went to great lengths and put in a lot of effort to make sure this power comes to each and every one of us who has the will to awaken his/her mangekyo sharingan.<br><br>\r\nLet us know in the comments below which other powers/abilities you would like to gain and we will make sure to put them on our tees.<br><br>\r\nThis naruto anime t shirt is screen printed on a 100% cotton black colored psycho store t shirt.', 'images/product/23/kamui_sharingan.png', 499, 21, '2016-09-09 21:18:49', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychofamous', 'inhouse', 1, 'Gaming'),
(24, 'tshirt', 10, 'Pokemon', 'Being Squirtle', 'being squirtle pokemon anime t shirt india', 'Every time you don''t feel like taking a bath or if you are in dire need of water, you can always count on this water pokemon t shirt fulfilling all your water requirements', 'This happened when I was travelling through The Great Indian Thar desert on my newly bought royal enfield. But I couldn''t be more wrong about the harsh difficulties one faces in the desert and as everyone can guess I was in dire need of water, but i only had charmander and pikachu pokemon t shirts with me which obviously were useless for me at that moment.<br><br>\r\nIt was then and there that i decided that I need to keep a water pokemon tee also with me if i need to continue my travelling escapades.<br>I notified my research team to again track down ash ketchum and since we were on good terms from our last meeting he easily gave us access to everyone''s beloved squirtle from which our scientists extracted some tissues and infused them into this awesome squirtle tee.<br><br>\r\nNote: no pokemons were hurt in the making of this tee.<br><br>\r\nLet us know in the comments below which other pokemons you want to keep in your closet.<br><br>\r\nThis pokemon anime t shirt is screen printed on a 100% cotton turquoise colored psycho store t shirt.', 'images/product/24/squirtle.png', 499, 1, '2017-02-16 08:12:07', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychofamous', 'inhouse', 0, 'Gaming'),
(25, 'tshirt', 25, 'Pokemon', 'Bulbaaaa', 'bulbasaur pokemon anime t shirt india', 'Somethings achieve evergreen status, for others here''s this bulbasaur pokemon t shirt.', 'The same time when I realized that I need a water pokemon t-shirt (read the product description of squirtle tee if you still haven''t http://bit.ly/2layNL2 ), I thought hey why not get bulbasaur also, so that I can also rest in natural shade whenever I want to. I mean if i am gonna get some water pokemon then better to get both at once and not to keep on pestering ash ketchum again and again.<br><br>\r\nSo here we are to satisfy all your green needs (pun intended)<br>\r\nYes, I did get my scientists to inject organic greenry for our pot lover friends in this tee. yes I can hear you screaming with joy over the analytics screen<br>\r\nYou can always thank me later after you get the tee.<br><br>\r\nNote : Don''t believe everything you read on the internet.<br><br>\r\nLet us know in the comments below which other pokemons you want to keep in your closet.<br><br>\r\nThis pokemon anime t shirt is screen printed on a 100% cotton green colored psycho store t shirt.', 'images/product/25/bulbasaur.png', 499, 0, '2017-02-16 08:44:25', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychofamous', 'inhouse', 0, 'Gaming'),
(26, 'tshirt', 23, 'Nothing', 'Otaku At Heart', 'otaku at heart anime t shirt india', 'Grab this otaku t shirt and show the whole world where your heart really is. A true otaku just cannot miss this design.', 'It''s tough, it''s really tough to explain the world what we truly are, deep down in our hearts what we truly desire. This t-shirt is just one way to let the whole world know what you crave for. We made this design for all those true otaku heads that need to show their love for this amazing culture by donning this tee.<br><br>\r\nAlthough we are aware that for most, you will just end up explaining what this word actually means and if this even is an actual word or not, but hey whatever helps in spreading this culture.<br>\r\nFor those interested here''s a link for clarification <a target="_blank" href="https://en.wikipedia.org/wiki/Otaku">Otaku? what''s that?</a><br><br>\r\nLet us know your views in the comments below.<br><br>\r\nThis otaku anime t shirt is screen printed on a 100% cotton black colored psycho store t shirt.', 'images/product/26/otaku.png', 499, 0, '2017-02-27 20:43:08', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychofamous', 'inhouse', 0, 'Gaming'),
(27, 'tshirt', 2, 'One Piece', 'Luffy''s Gatling gun', 'luffys gatling gun one piece anime t shirt india', '"gommu gommu no gatling" - Monkey D. Luffy. Grab this one piece t shirt with one of the most inconic attack from everyone''s favorite straw hat man.', 'Honestly, there have been countless instances where I wished I had this gatling gun power of luffy at my disposal, times when you just cannot control your rage and feel like punching endlessly.  So when introducing the one piece tee for the first time I knew that it had to somehow give me this ability. <br>\r\nFollowing are just some of the situations where this t shirt can be useful for you :\r\n<br><br>\r\n1. Losing a fifa match or ball hitting the goal post again and again.<br>\r\n2. Your team mates playing shit in counter strike / dota. <br>\r\n3. Your  boss/client talking non sense and not making any sense. <br>\r\n4. Not able to find that one annoying bug no matter how much you debug. <br>\r\n5. Video keeps buffering while watching your favorite thing.<br>\r\n5. Getting killed because of lag. <br><br>\r\nDesign By <a href="https://www.facebook.com/cerinius/" target="_blank"> Anwesha Pradhan.</a><br><br>\r\nLet us know in the comments below about more situations where you might prefer to use this attack. <br><br>\r\nThis one piece anime t shirt is screen printed on a 100% cotton black colored psycho store t shirt.', 'images/product/27/gatling_gun_1.png', 599, 0, '2017-03-18 19:02:59', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychofamous', 'inhouse', 0, 'Gaming'),
(28, 'tshirt', 1, 'Half-Life', 'Black Mesa Research Facility', 'black mesa research facility half life gaming t shirt india', '"Good morning and welcome to the black mesa transit system. Please wear this t-shirt at all times while handling any hazardous materials for your own safety." - Black mesa announcement system.', 'After the infamous <a href="http://combineoverwiki.net/wiki/Black_Mesa_Incident">black mesa incident</a>, we were approached by the black mesa management to create a special tee which would protect the scientists in case a similar incident was to happen again (and we were thinking "yeah right as if you really care about the scientists, we know what you did back then").<br>\r\nBut anyway business is business, so we accepted the offer, they obviously gave us some special chemical and xen substances to integrate in the t-shirt using which we made this half-life t-shirt which is in front of you.<br><br>\r\nWe were able to struck a deal with them where in we got the liberty to provide it to all our fans as well, just in case the next incident was to happen on a much larger scale (see how much we care about you guys).<br>\r\nDo wear this black mesa t-shirt at all times while handling any kind of hazardous materials.<br><br>\r\nLet us know your views in the comments below.<br><br>\r\nThis Half-life inspired gaming t shirt is screen printed on a 100% cotton white colored psycho store t shirt.', 'images/product/28/black_mesa.png', 499, 2, '2017-03-19 13:33:58', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychofamous', 'inhouse', 1, 'Gaming'),
(29, 'tshirt', 0, 'Overwatch', 'Die Die Die', 'reaper walks overwatch gaming t shirt india', 'Watch everyone around you run for cover as you walk around like death, wearing this overwatch reaper t shirt. Just don''t start yelling die, die, die yourself, let reaper do the talking.', 'I still remember it like it happened just few minutes back. I was totally engrossed in programming when I heard that loud thud in my living room, it was 3 am in the night. It was pretty strange but still I went to see what was happening and to my astonishment I saw reaper standing there, like actually standing right in front of me. I was literally dumbfound and didn''t know how to react as I had played reaper before but he was not my first choice. But never imagined that it would bring him to me in reality. <br><br>\r\nReaper : "I heard you are launching a new overwatch inspired t shirt?"<br>\r\nMe : "Wow! we didn''t knew we were so famous among overwatch heroes."<br>\r\nReaper : "Can I know which hero are you chosing first?"<br>\r\nMe : "Well honestly I am thinking of going with tracer since shes everyone''s heartthrob."<br>\r\nReaper : "I kneeeeeew it! You wouldn''t chose me. Anyway  I have a confession to make. I might come of as a really dark and strong character which I am btw, without a doubt. But still honestly I am also pretty soft at heart and I want you guys to help me change people''s perception of me by launching a cute but yet a strong design of mine."<br>\r\nMe : "Well, this actually sounds like a nice idea, I guess tracer can wait a bit. We can do this for you."<br>\r\nReaper : "Good, I will be looking forward to it and btw don''t forget to add my favorite line"<br>\r\nMe : "Die! Die! Die!"<br><br>\r\nSo here we are, finally fulfilling our promise to reaper who btw made us change the design n no. of times (hence the delay in launch). Believe us guys he is actually pretty soft at heart once he stops yelling.<br><br>\r\nDesign By <a href="https://www.facebook.com/cerinius/" target="_blank"> Anwesha Pradhan.</a><br><br>\r\nLet us know which hero you want us to design next.<br><br>\r\nThis overwatch inspired gaming t shirt is digitally printed on a 100% cotton turquoise colored psycho store t shirt.', 'images/product/29/overwatch_reaper.png', 599, 4, '2017-04-02 20:14:47', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychofamous', 'inhouse', 1, 'Gaming'),
(30, 'posters', 0, 'Half-Life', 'Black Mesa Research Facility', 'black mesa research facility half life gaming posters india', 'blah', 'blah blah', 'images/product/30/poster.png', 299, 0, '2017-04-24 18:31:24', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychofamous', 'inhouse', 0, 'Gaming'),
(31, 'tshirt', 0, 'Dragon Ball Z', 'Goku Super Saiyan Blue', 'goku super saiyan blue dragon ball z anime t shirts india', 'You don''t need 5 super saiyans anymore to transform yourself into a super saiyan god. Just put on this dragon ball z goku super saiyan blue t shirt and experience the power of the god anytime, anyplace. For times when 9000 power level isn''t just enough.', 'So it had been quite some time and my power level was lingering somewhere around 9000 or more. I thought maybe saitama''s workout routing might help but seriously I wasn''t seeing much improvement (I didn''t go bald though so I don''t know if that is a necessary condition for the workout to be effective or not).<br><br>\r\nI had complete faith in my psycho labs scientists, so i set to work to contact goku himself. To be honest we used our 2 months food supply in order to keep goku fed for just 2 days. Chi Chi have my symapthies.<br> So finally our scientists set to work to infuse goku''s genes and tissues and whatnot into our very own cloth material to make sure that who ever wears this dragon ball z t shirt is bound to go super saiyan blue.<br><br>\r\nGoing super saiyan blue had never been easier.<br><br>\r\nLet us know your super saiyan moments in the comments below.<br><br>\r\nThis dragon ball z goku super saiyna blue anime t shirt is digitally printed on a 100% cotton black colored psycho store t shirt.', 'images/product/31/goku_blue.png', 599, 0, '2017-05-02 15:10:04', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychofamous', 'inhouse', 0, 'Gaming'),
(32, 'tshirt', 0, 'Attack On Titan', 'Dawn Of The Titans', 'dawn of the attack on titan anime t shirt india', 'Grab this attack on titan inspired anime t shirt and let the whole world know about the grave and desperate times humanity is in.', 'Even though recon corps are losing their lives while fighting with different types of titans, but not all of the humanity is aware of the grave times we are in.<br>\r\nWe made this tee specially for you to wear and make the whole world aware that the titans are coming. It is time to fight, for the survival of the humanity.<br><br>\r\nWe will all perish if we don''t stand together against the titans.<br><br>\r\nLet us know your views in the comments below..<br><br>\r\nThis attack on titan inspired anime t shirt is digitally printed on a 100% cotton black colored psycho store t shirt.', 'images/product/32/dawn.png', 499, 0, '2017-05-08 20:39:53', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychofamous', 'inhouse', 0, 'Gaming'),
(33, 'tshirt', 0, 'Halo', 'Master Chief', 'master chief halo gaming t shirt india', 'We know how much we all want a companion like cortana, but sadly we don''t have master chief''s helmet to insert cortana''s chip into (we have the chip, believe us). So this halo inspired tee is the closest we can get to wearing master chief''s helmet.', 'I still remember the time when master chief first came into view and that helmet was the first thing that made a strong impression in my mind. Ever since then I have been wanting to own a similar head gear into which i can just insert cortana''s chip and voila! a priceless companion will be with me. <br><br>\r\nBut nope, the world does not work like that. we still have ignorant people on this planet who would serve you pepsi when asked for coke. How can you expect a working master chief helmet in this world then?<br><br>\r\nBut not everything is lost, we made this halo inspired minimalist design of master chief''s helmet to give us company until people can differentiate between pesi and coke and start working on things that matter.<br><br>\r\nLet us know your favorite master chief moments in the coments below.<br><br>\r\nThis halo gaming t shirt is digitally printed on a 100% cotton green colored psycho store t shirt.', 'images/product/33/halo.png', 499, 0, '2017-05-08 20:51:10', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychofamous', 'inhouse', 0, 'Gaming'),
(34, 'tshirt', 0, 'Nier Automata', 'Whats the report', 'pod report 2b nier gaming t shirts india', 'Show some love to your pod042 who helped you so much in your battles against machine life forms by wearing this design inspired by your favorite bot 2B from nier automata.', 'It was just another day for us, we were busy with intercepting random frequencies to eavesdrop on people''s conversations, but somehow we hit the jackpot, we actually heard pod 042 reporting to YoRHa about everyone''s favorite bot 2B.<br><br>\r\nYoRHa: "What''s the report"?<br>\r\nPod 042 : "Report : satisfied, but mmm there is something I would like to complain about."<br>\r\nYoRHa : "Is it about 2B"?<br>\r\nPod 042 : "Yes, exactly, I know 2B is busy fighting and everything but still even when she is standing idle she doesn''t pat me much. Patting me makes my electrons move a bit faster and I get a very strange but exciting feeling which I have started to miss these days".<br>\r\nYoRHa : "Don''t worry, we will see that the point gets across to 2B".<br><br>\r\nSo Pod 042 needs some love from 2B. We knew exactly what we had to do and here it is, we made this design for all you moon dwellers. So wear this t shirt to show your support for the cause that 2B should pat pod 042 more.<br><br>\r\nDesign By <a href="https://www.facebook.com/cerinius/" target="_blank"> Anwesha Pradhan.</a><br><br>\r\nLet us know your favorite moments between 2B and pod 042.<br><br>\r\nThis nier automata 2B gaming t shirt is digitally printed on a 100% cotton grey colored psycho store t shirt.', 'images/product/34/nier.png', 599, 0, '2017-05-25 21:50:44', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychofamous', 'inhouse', 0, 'Gaming'),
(35, 'tshirt', 0, 'Dragon Ball Z', 'God Mode Saiyan prince', 'vegeta super saiyan blue dragon ball z anime t shirt india', 'Pride and honor are two major traits that define this saiyan prince. So wear this vegeta inspired dragon ball z t shirt and get that saiyan pride and honor infused in yourself. By the way that super saiyan blue power level is just an added advantage.', 'I had already reached the super saiyan blue power level with the previous <a href="http://psychostore.in/product/81/goku-super-saiyan-blue-dragon-ball-z-anime-t-shirts-india"> goku tee</a>.<br>\r\nBut still there was something missing, something that I just could not pin point on and then i had en epiphany, i realized that whatever level goku has reached is partly because of vegeta, his fierce competitor that drove him to power up and also because of the traits (pride and honor) that vegeta values so much.<br><br>\r\nPride and honor is what i am missing on and wish to gain. So here we are with a new vegeta inspired design that would help you gain those traits and master your new super saiyan blue power level.<br><br>\r\nGoing super saiyan blue had never been easier.<br><br>\r\nLet us know your super saiyan moments in the comments below.<br><br>\r\nThis dragon ball z vegeta super saiyan blue anime t shirt is digitally printed on a 100% cotton black colored psycho store t shirt.', 'images/product/35/vegeta_ssb.png', 599, 0, '2017-05-26 11:43:51', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychofamous', 'inhouse', 0, 'Gaming'),
(36, 'tshirt', 0, 'Nothing', 'Infected Specimen', 'biohazard infected specimen gaming t shirts india', 'Please contact your nearest quarantine authorities immediately when you spot an infected specimen. Also make him/her wear this biohazard t-shirt so that everyone can easily identify who the infected specimens are.', 'I had been saying this for years, but nope, no one listens to me. Global warming, dying species, failing economy, etc etc used to be the talk of the time when we were supposed to be discussing about effing zombie apocalypse. Well no point talking about it since it''s already here now.<br><br>\r\nAnyway, now is the time to listen to me and listen very closely my fellow earthlings. After extensive research in our psycho labs, our scientists have uncovered a very special and hidden weakness of these zombies. The special feature of this particular design is that infected people''s mind somehow thinks that another person wearing this design is also infected.<br><br>\r\nSo we did what we do best, we printed this life saving design on our t-shirts for all you earthlings to wear and save yourself from these zombies because once you wear this tee, all the zombies will think that you are also one of them and won''t attack you.<br><br>\r\nAlso, needless to say we have sent our very capable and skilled minions as spies into zombie''s territories to find out more about them.<br>\r\nWe will keep you updated on the progress.<br><br>\r\nLet us know your zombie moments in the comments below.<br><br>\r\nThis zombies gaming t shirt is digitally printed on a 100% cotton white colored psycho store t shirt.', 'images/product/36/biohazard_white.png', 499, 0, '2017-06-15 11:53:45', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychofamous', 'inhouse', 0, 'Gaming'),
(37, 'tshirt', 0, 'Dark Souls', 'The Abysswalker', 'artorias the abysswalker dark souls gaming t shirts india', 'If you stare long into the abyss, the abyss stares back. get this dark souls inspired t shirt sporting one of the commanding knights of lord gwyn''s army, artorias the abysswalker along with his loyal battle companion the great grey wolf sif.', 'Rumors are that after sir artorias the abysswalker was consumed by the darkness of the abyss, a particular design was found in his belongings which people presumed he thought of engraving it on his shield or maybe armour. Even after ages, that design is quite a legend and a lot of people still keep that design in their possession out of  respect for the legendary knight<br><br>\r\nAs soon as we got to know about it, we sent our bravest minions to gather information about that design from New londos or oolacile. We trusted our minions and yes did not disappoint us, they came back with information which we used to create this spectacular design.<br><br>\r\nSo show your respect for the legendary knight by wearing this dark souls t shirt. Also, don''t expect you will get the abysswalking ability after wearing it.<br><br>\r\nLet us know your darkest abyss moments in the comments below.<br><br>\r\nThis darks souls artorias the abysswalker gaming t shirt is digitally printed on a 100% cotton coffee colored psycho store t shirt.', 'images/product/37/artorias_3.png', 599, 0, '2017-06-21 15:22:36', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychofamous', 'inhouse', 0, 'Gaming'),
(38, 'tshirt', 0, 'Overwatch', 'Cheers Love Cavalrys here', 'cheers love cavalrys here tracer overwatch gaming t shirts india', 'Cheers love! The tracer inspired overwatch t shirt is here.', 'After the tragic accident of the teleporting fighter plane, splitstream, everyone had lost hope for lena oxton aka tracer. Luckily she resurfaced few months back but that accident had already taken it''s toll. It was difficult for her just to maintain her physical form in the present, she practically became a living ghost. We have winston to thanks for bringing stability to tracer and giving her the powers to zip through time.<br>\r\nBut little did we know that winston is still working on ways to even enhance tracer''s abilities and empower her even more.<br><br>\r\nWe have reasonable reasons to believe that this design will be used to further enhance her powers and being the good guys we are, we decided to launch this design on our tees for all our fans and tracer''s fans to wear and enhance their powers as well.<br><br>\r\nDesign By <a href="https://www.facebook.com/cerinius/" target="_blank"> Anwesha Pradhan.</a><br><br>\r\nLet us know your favorite overwatch character in the comments below<br><br>\r\nThis overwatch tracer gaming t shirt is printed using direct to garment printing on a 100% cotton white colored psycho store t shirt.', 'images/product/38/tracer_white.png', 599, 0, '2017-07-05 09:38:47', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychofamous', 'inhouse', 0, 'Gaming'),
(39, 'tshirt', 0, 'Dragon Ball Z', 'Goku Saiyan Evolution', 'goku saiyan evolution dragon ball z anime t shirts india', 'What is you evolution level? Whatever it may be, just wear this dragon ball z inspired goku t shirt and reach your max power level.', 'While we reached our supper saiyan blue level and were wearing our <a href="http://psychostore.in/product/81/goku-super-saiyan-blue-dragon-ball-z-anime-t-shirts-india">Super Saiyan Blue </a> t shirt, we did come across a lot of people who were still training and were below our power level and they wanted a t shirt to suit their power level.<br>\r\nThey did not want to wear the blue saiyan tee while being just in the super saiyan form as a respect to higher power level people.<br><br>\r\nWe realized that not all people are at the same level, so we bring to you our latest saiyan evolution design. now it does not matter which stage of evolution you are at, you are bound to be somewhere between these three.<br><br>\r\nDesign By : Pratik Bhattacharjee<br><br>\r\nLet us know your saiyan evolution stage in the comments below.<br><br>\r\nThis goku saiyan evolution dragon ball z inspired anime t shirt is digitally printed on a 100% cotton black colored psycho store t shirt.', 'images/product/39/evolution.png', 599, 0, '2017-07-18 12:56:34', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychofamous', 'inhouse', 0, 'Gaming'),
(40, 'tshirt', 1, 'Naruto', 'Uchiha Crest', 'uchiha crest naruto anime t shirts india', 'Wear this uchiha crest t shirt to awaken your sleeping sharingan.', 'I realized the importance of this symbol when I went trekking last week. Although I had my <a href="http://psychostore.in/product/23/kamui-mangekyo-sharingan-naruto-anime-t-shirt-india">Kamui</a> tee with me which allowed me to see a lot of hidden things. <br><br>\r\nBut do you have any idea how difficult it is to light up a fire? That is the time when I decided the first thing I need to do after returning to civilisation is to launch an uchiha inspired t shirt so that everyone can have this ability to create a fire whenever required. Well technically not everyone but only those who are willing to train and harness their energy.<br><br>\r\nSo get your hands on this uchiha crest t-shirt and join the family of fire breathers.<br><br>\r\nLet us know your sharingan awakening moments in the comments below.<br><br>\r\nThis uchiha crest naruto inspired anime t shirt is digitally printed on a 100% cotton navy blue colored psycho store t shirt.', 'images/product/40/uchiha.png', 599, 0, '2017-08-07 12:01:25', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychofamous', 'inhouse', 0, 'Gaming'),
(41, 'tshirt', 1, 'Rick And Morty', 'Pickle Rick', 'call me pickle rick and morty cartoon t shirts india', 'Get your own version of pickle rick now with this rick and morty inspired t shirt.', 'We know that not everyone is capable enough to convert themselves into a pickle through science or any other way as well. So after doing all the dirty work for you, here we are with our all new rick and morty t shirt featuring the very famous pickle rick.<br><br>\r\nNow the interesting thing is that the pickle rick is not just for showing off, but this tee has the power to convert you into a pickle < insert your name here >.<br>\r\nIf you are thinking exactly how it will work, then we have a surprise for you, we won''t be telling you the exact procedure as we want all of you to put your thinking caps on and figure out the mystery for yourselves.<br><br>\r\nNote : (Our lawyers forced us to add it here) we shall not be held responsible if a cat comes and considers you a snake and eats you up.\r\n<br><br>\r\nLet us know your pickle moments in the comments below.<br><br>\r\nThis rick and morty cartoon t shirt is digitally printed on a 100% royal blue colored psycho store t shirt.', 'images/product/41/pickle.png', 599, 0, '2017-09-15 07:40:25', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychofamous', 'inhouse', 0, 'Gaming'),
(42, 'tshirt', 1, 'Rick And Morty', 'What You Looking At', 'rick and morty cartoon t shirts india', 'This Rick and morty t shirt gives you the answer to all the queer looks you get in life.', 'You know the looks you get when you are the odd one out, when you don''t fit in with the expectations of the normality.<br>\r\nI am sure almost everyone has felt that way at least once in their life, if not then really you need to, only then you will understand the feeling behind this amazing rick and morty design.<br><br>\r\nBut the important thing is that now you can let this tee answer all those looks for you.So you can focus on doing things you are best at and that is being queer.<br><br>\r\nDesign By : Pratik Bhattacharjee<br><br>\r\nLet us know your experiences in the comments below.<br><br>\r\nThis Rick and morty cartoon t shirt is digitally printed on a 100% cotton turquoise colored psycho store t shirt.', 'images/product/42/rickandmorty.png', 599, 0, '2017-09-21 19:44:38', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychofamous', 'inhouse', 0, 'Gaming'),
(43, 'tshirt', 1, 'Dragon Ball Z', 'Goku Kame Black', 'dragon ball z goku kame black anime t shirt india', 'Continue your training at 100G now in this dragon ball z inspired black goku kame tee.', 'Although we agree that nothing can beat the feeling of dressing up like goku, but well we realized that we are not actually inside an anime and we do not some variety with our clothes.<br> but yes it''s too tough to do your training in any dress that does not have a kame or kang kai''s symbol on it.<br><br>\r\nSo here it  is guys, for all you dragon ball z enthusiasts, get this goku kame black symbol tee.<br><br>\r\nLet us know your views in the comments below<br><br>\r\nThis goku black kame dragon ball z inspired anime t shirt is digitally printed on a 100% cotton blackcolored psycho store t shirt.', 'images/product/43/goku_black.png', 599, 0, '2017-09-22 13:08:30', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychofamous', 'inhouse', 0, 'Gaming');
INSERT INTO `products` (`product_id`, `product_type`, `design_id`, `product_game`, `product_name`, `product_url`, `product_intro`, `product_desc`, `product_image_path`, `product_price`, `product_qty_sold`, `product_date`, `add_to_cart_comment`, `product_state`, `hashtag`, `product_source`, `featured`, `category`) VALUES
(44, 'tshirt', 1, 'The Witcher 3', 'Witcher Wolf Medallion', 'witcher 3 wolf medallion swords gaming t shirts india', 'Show the whole world which school you belong to by getting this wolf medallion gaming t shirt inspired by one of the best games of this generation The Witcher 3.', 'Ever since our first interview with geralt, we have been wanting to tell him how we were able to infuse the magical substances that he gave us into our tee. We had sent him a raven long back and we were really thrilled when we got a response from him stating that he would love to come and see it for himself.<br><br>\r\nYou can imagine our excitement level was over 9000 at that time and our whole team was in full preparation to welcome him.<br>\r\nFinally the day came, everything was going super fine until he saw our previous <a href="http://psychostore.in/product/16/witcher-3-white-wolf-gaming-t-shirts-india">design </a>and was like "Guys where are my swords? Why aren''t they in the design?"<br><br>\r\nAll of us were stunned, why didn''t any of us think of it before, how can we even miss it. So as promised to geralt here we are with our new and improved medallion design along with geralt''s swords as well.<br><br>\r\n Design By : <a target="_blank" href="https://jit-art.deviantart.com/">Arijit Sarkar</a><br><br>\r\nLet us know your monster hunting experiences in the comments below. <br><br>\r\nThis witcher 3 wolf wolf medallion gaming t shirt is digitally printed on a 100% cotton black colored psycho store t shirt.', 'images/product/44/wolf_medallion.png', 599, 0, '2017-10-30 18:50:42', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychofamous', 'inhouse', 0, 'Gaming'),
(45, 'tshirt', 1, 'Star Wars', 'Star Wars The Last jedi', 'star wars the last jedi movie t shirts india', 'The force is strong with this star wars last jedi inspired t shirt. Wear it and get the force on your side.', 'We all know how rey is rumored to be the last jedi. But all of us here at psycho store literally hate this fact. What if a zombie apocalypse happens in the near future and there are no jedis to save us? I personally believe that a light saber is a perfect weapon for a zombie apocalypse. Light weight handy, portable and is something which isn''t dependent on an external thing like a gun.<br><br>\r\nImagine running out of ammo right in the middle of a zombie invasion, that can never happen with a light saber, right?<br><br>\r\nhence proved that this world needs more jedis (and more light sabers) to prevent future zombie apocalypse among other things as well.<br>\r\nSo your friendly neighborhood geeks have developed this star wars tee which will help accelerate your growth towards becoming a jedi.<br><br>\r\nDesign By : Pratik Bhattacharjee<br><br>\r\nLet us know your jedi moments in the comments below.<br><br>\r\nThis last jedi star wars inspired movie t shirt is digitally printed on a 100% cotton black colored psycho store t shirt.', 'images/product/45/lastjedi.png', 599, 0, '2017-11-02 20:20:00', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychofamous', 'inhouse', 0, 'Gaming'),
(46, 'tshirt', 1, 'Dragon Ball Z', 'Goku Ultra Instinct', 'goku ultra instinct dragon ball super anime t shirts india', 'Achieve that unbeatable ultra instinct state with this insane dragon ball super inspired goku ultra instinct t shirt.', 'Ever since those insanely famous 109 and 110 episodes were aired in Dragon Ball Super the whole world was in a frenzy to know more about that new state which even our lord beerus has not been able to master yet.<br><br>\r\nYes, you guessed it right we are talking about everyone''s favorite Ultra Insinct state. Although we are still confused if it is a new state or a new transformation. Personally we believe it''s a state of being rather than another transformation.<br><br>\r\nJust imagine being in that state while transformed into super saiyan blue and with Kaio-Ken as a cherry on the top.<br>\r\nSo get yourself this new goku ultra instinct tee before goku starts fighting jiren again. You just have to wear this tee as respect and support to goku while watching goku fight jiren in order to save our universe.<br><br>\r\nLet us know your favorite ultra instinct moments in the comments below.<br><br>\r\nThis dragon ball super inspired goku ultra instinct anime t shirt is digitally printed on a 100% black colored psycho store t shirt.', 'images/product/46/goku_ui.png', 599, 0, '2017-11-21 12:45:18', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychofamous', 'inhouse', 0, 'Gaming'),
(47, 'tshirt', 1, 'Rick And Morty', 'Evil Morty', 'supreme evil rick and morty cartoon t shirt india', 'It is time for celebration as our supreme leader has launched this new design for all his loving citizens.', 'It was just another morning in the citadel of ricks when suddenly this thing was all over the news that our supreme leader has organised a speech for a very importance announcement in the afternoon right middle of the city.\r\nAs the good citizens we are , everyone made sure that they could attend it.<br><br>\r\nSupreme Leader : "This seems like a good time for a drink, and a cold calculated speech with sinister overtones. A speech about politics, about order, brotherhood, power. But speeches are for campaigning. Now is the time for action. SO get into action by getting yourself this evil morty tee shirt."<br><br>\r\nThat was the time when this new design was first made public to the world, every one was blown away, including us<br>\r\nSo we made sure that we make this design available to you all because my friends it is the time for action.<br><br>\r\nDesign By : Joel Monteiro<br><br>\r\nLet us know your favorite rick and morty moments in the comments below.<br><br>\r\nThis rick and morty inspired evil morty cartoon t shirt is digitally printed on a 100% cotton white colored psycho store t shirt.', 'images/product/47/evil_morty.png', 599, 0, '2017-11-24 16:08:42', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychofamous', 'inhouse', 0, 'Gaming'),
(48, 'tshirt', 1, 'Grand Theft Auto', 'Trevor The Psychopath', 'trevor the psychopath gta v gaming t shirts india', 'Do you have that madness in you to match that of trevor''s? With this gta v inspired tee you can definitely achieve it.', 'So me and my friend was at this really good cafe whose food both of us religiously loved. My friend was lost in some kind of life contemplation zone for past few minutes now and I was waiting for him to snap out of it. Suddenly he comes out of the zone and says "i have figured it out" and calls the waiter,<br>\r\nThe waiter  wasn''t a regular seemed like a new hire, anyway and my friend just ordered a coke after all the "I have figured it out" excitement. I was a bit confused and looked at him with that "waiting for an explanation" expressions. He looks at me and goes like\r\n"I was trying to figure out which soft drink will taste best with this out of the world burger"<br><br>\r\nRight, talk about priorities.<br><br>\r\nhe got his glass of soft drink, takes a sip with so much excitement and just starts cursing loudly and I was like "calm down man. What happened?"<br>\r\nHe calls the waiter back<br>\r\nFriend : "What kind of joke is this?"<br>\r\nwaiter clearly a bit confused, but surely irritated,<br>\r\nWaiter : "what, I don''t understand?"<br>\r\nF: "i clearly remember ordering coke and you bring me a glass of pepsi, do you even understand the basics of how this world works."<br>\r\nNow waiter clearly losing his temper<br>\r\nW: "Don''t eat my head man, they are basically the same thing."<br>\r\nNow I don''t know which world this waiter was from but in my world this will lead to chaos and anarchy of a totally different scale.\r\nSo after a few broken glasses and plates, calling friends for backup, chasing a car on our bike and some bone shattering punches here and there, we finally managed to call it a day and head home.<br><br>\r\nAll the while I was reminded of this guy who deserves a design from us. Still don''t know what took us so long to bring this out.<br>\r\nAnyway now that it''s here feed your madness with this amazing ode to the guys who defines what true madness is, Tevor Phillips.<br><br>\r\nDesign By : Ajax Kumawat<br><br>\r\nLet us know your favorite moments of madness in comments below.<br>\r\nThis gta v inspired trevor gaming t-shirt is digitally printed on a 100% cotton black colored psycho store t shirt.', 'images/product/48/trevor.png', 599, 0, '2017-11-27 15:38:42', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychofamous', 'inhouse', 0, 'Gaming'),
(49, 'tshirt', 1, 'Deathnote', 'This is my cake', 'l the justice cake deathnote anime t shirts india', 'Let L do the talking with the people who keep staring at your cake. Get this deathnote inspired L tee to keep your cakes safe and sound.', 'We were honestly very tired with these special species of humans who keep on demanding one bite of your cake every time you seem to be enjoying one.<br>\r\nThis was very much in everyone''s knowledge that an imminent solution is required to contain these kind of people.<br><br>\r\nSo our scientists went to work and one day in her dreams came L and gave her the secret to howhe used to make sure that no one can ever touch his cake.<br>\r\nSO with this new equipped knowledge we went to work and we are really proud to announce that  we have created a nice little chibi solution to this problem.<br><br>\r\nTried and tested with 99% accuracy on humans.<br><br>\r\nP.S : we tried this on our dog, nope doesn''t work.<br><br>\r\nDesign By <a href="https://www.facebook.com/cerinius/" target="_blank"> Anwesha Pradhan.</a><br><br>\r\nLet us know your favorite L moments in the comments below.<br><br>\r\nThis L inspired deathnote anime t shirt is digitally printed on a 100% golden yellow colored psycho store t shirt.', 'images/product/49/a_mycake_yellow.png', 599, 0, '2017-12-24 19:12:10', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychofamous', 'inhouse', 0, 'Gaming');
